potential to disrupt existing industrial approaches\nwe are particularly looking to fund projects in energy harvesting, imaging technologies, graphene or biofilms\nany enabling technology in: satellite applications; electronics\nsensors; photonics; digital; internet of things; data; cybersecurity\nvirtual or augmented reality; and distributed ledger technology\nThe type of innovation project will depend on the challenges and opportunities your business faces.\n\nProposals must show how project success will improve business growth and productivity and/or encourage export opportunities, including for at least one UK small and medium-sized enterprise (SME) involved in the project.',NULL,0),(61,61,'How to apply','The lead applicant must register for an account using the link on this page. This will start the application process. During this process the lead applicant will be able to invite all other collaborators. Collaborators will be sent a link, which will help them to create an account and give them access to the application.',NULL,0),(62,93,'Background and further information','Technology is transforming our lives and brings great opportunity. The UK is strong in fundamental research across many different disciplines. However, we sometimes struggle to fully commercialise the opportunities. The most promising emerging technologies and industries need to be guided through the innovation process to market success.\n',NULL,0);
