INSERT INTO `form_input` VALUES (191,NULL,5,2,1,'Application details',NULL,NULL,0,43,'APPLICATION','',NULL),(192,400,2,2,1,'Project summary','What should I include in the project summary?','<p>We will not score this summary, but it will give the assessors a useful introduction to your project. It should provide a clear overview of the whole project, including:</p> <ul class=\"list-bullet\">         <li>your vision for the project</li><li>key objectives</li><li>main areas of focus</li><li>details of how it is innovative</li></ul>',0,44,'APPLICATION','',NULL),(193,400,2,2,1,'Public description','What should I include in the project public description?','<p>Innovate UK publishes information about projects we have funded. This is in line with government practice on openness and transparency of public-funded activities.</p><p>Describe your project in a way that will be easy for a non-specialist to understand. Don\'t include any information that is confidential, for example, intellectual property or patent details.</p> ',0,45,'APPLICATION','',NULL),(194,400,2,2,1,'How does your project align with the scope of this competition?','What should I include in the project scope?','<p>It is important that you read the following guidance.</p><p>To show how your project aligns with the scope of this competition, you need to:</p><ul class=\"list-bullet\">         <li>read the competition brief in full</li><li>understand the background, challenge and scope of the competition</li><li>address the research objectives in your application</li><li>match your project\'s objectives and activities to these</li></ul> <p>Once you have submitted your application, you should not change this section unless:</p><ul class=\"list-bullet\">         <li>we ask you to provide more information</li><li>we ask you to make it clearer</li></ul> ',0,46,'APPLICATION','',NULL),(195,NULL,21,2,0,'Please select the research category for this project',NULL,NULL,0,46,'ASSESSMENT','',NULL),(196,NULL,22,2,0,'Is the application in scope?',NULL,NULL,1,46,'ASSESSMENT','',NULL),(197,100,2,2,0,'Feedback','Guidance for assessing scope','You should still assess this application even if you think that it is not in scope. Your answer should be based upon the following:',2,46,'ASSESSMENT','',NULL),(198,400,2,2,1,'1. What is the business opportunity that your project addresses?','What should I include in the business opportunity section?','<p>You should describe:</p><ul class=\"list-bullet\">         <li>the business opportunity you have identified and how you plan to take advantage of it</li><li>the customer needs you have identified and how your project will meet them</li><li>the challenges you expect to face and how you will overcome them</li></ul>',0,47,'APPLICATION','',NULL),(199,NULL,23,2,0,'Question score',NULL,NULL,0,47,'ASSESSMENT','',NULL),(200,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,47,'APPLICATION','\0','PDF'),(201,100,2,2,0,'Feedback','Guidance for assessing business opportunity','Your score should be based upon the following:',1,47,'ASSESSMENT','',NULL),(202,400,2,2,1,'2. What is the size of the potential market for your project?','What should I include in the market opportunity section?','<p>Describe the size of the potential market for your project, including:</p><ul class=\"list-bullet\">         <li>details of your target market, for instance, how competitive and profitable it is</li><li>the current size of the market, with actual and predicted growth rates</li><li>the market share you expect to achieve and the reasons for this estimate</li><li>the wider economic value you expect your project to add to the UK and/or the EEA (European Economic Area)</li></ul><p>Tell us what return on investment you expect your project to achieve. You should base this estimate on relevant industry data and tell us how you have calculated this.</p><p>If you are targeting an undeveloped market, you should also:</p><ul class=\"list-bullet\">         <li>describe how you plan to access this market</li><li>estimate its potential size</li><li>explain how you will explore its potential</li></ul>',0,48,'APPLICATION','',NULL),(203,NULL,23,2,0,'Question score',NULL,NULL,0,48,'ASSESSMENT','',NULL),(204,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,48,'APPLICATION','\0','PDF'),(205,100,2,2,0,'Feedback','Guidance for assessing market opportunity','Your score should be based upon the following:',1,48,'ASSESSMENT','',NULL),(206,400,2,2,1,'3. How will you exploit and market your project?','What should I include in the project exploitation section?','<p>Describe the potential outputs of the project, such as:</p><ul class=\"list-bullet\">         <li>products or services</li><li>processes</li><li>applications</li></ul><p>Describe how you will exploit these outputs, such as:</p><ul class=\"list-bullet\">         <li>the route to market</li><li>protection of intellectual property rights</li><li>reconfiguration of your organisation\'s value system</li><li>changes to business models and processes</li><li>any other methods of exploitation and protection</li></ul> ',0,49,'APPLICATION','',NULL),(207,NULL,23,2,0,'Question score',NULL,NULL,0,49,'ASSESSMENT','',NULL),(208,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,49,'APPLICATION','\0','PDF'),(209,100,2,2,0,'Feedback','Guidance for assessing project exploitation','Your score should be based upon the following:',1,49,'ASSESSMENT','',NULL),(210,400,2,2,1,'4. What economic, social and environmental benefits do you expect your project to deliver and when?','What should I include in the benefits section?','<p>Describe all the benefits you expect your project to deliver, including:</p><p><strong>Economic</strong> : this is the real impact the project will have on its economic environment. This is not traditional corporate accounting profit and can include cost avoidance. You should identify and quantify any expected benefits to:</p><ul class=\"list-bullet\"><li>users (intermediaries and end users)</li><li>suppliers</li><li>broader industrial markets</li><li>the UK economy</li></ul><p><strong>Social</strong> : quantify any expected social impacts either positive or negative on, for example:</p><ul class=\"list-bullet\"><li>quality of life</li><li>social inclusion/exclusion</li><li>education</li><li>public empowerment</li><li>health and safety</li><li>regulation</li><li>diversity</li><li>government priorities</li></ul><p><strong>Environmental</strong> : show how your project will benefit or have a low impact on the environment. For example, this could include:<p><ul class=\"list-bullet\"><li>careful management of energy consumption</li><li>reductions in carbon emissions</li><li>reducing manufacturing and materials waste</li><li>rendering waste less toxic before disposing of it in a safe and legal manner</li><li>re-manufacturing (cradle to cradle)</li></ul>',0,50,'APPLICATION','',NULL),(211,NULL,23,2,0,'Question score',NULL,NULL,0,50,'ASSESSMENT','',NULL),(212,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,50,'APPLICATION','\0','PDF'),(213,100,2,2,0,'Feedback','Guidance for assessing economic benefits','Your score should be based upon the following:',1,50,'ASSESSMENT','',NULL),(214,400,2,2,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the technical approach section?','<p>You should:</p><ul class=\"list-bullet\">         <li>describe your technical approach including the main objectives of the work</li><li>explain how and why your approach is appropriate</li><li>tell us how you will make sure that the innovative steps in your project are achievable</li><li>describe rival technologies and alternative R&D strategies</li><li>explain why your proposed approach will offer a better outcome</li></ul>',0,51,'APPLICATION','',NULL),(215,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',0,51,'APPLICATION','','PDF'),(216,NULL,23,2,0,'Question score',NULL,NULL,0,51,'ASSESSMENT','',NULL),(217,100,2,2,0,'Feedback','Guidance for assessing technical approach','Your score should be based upon the following:',1,51,'ASSESSMENT','',NULL),(218,400,2,2,1,'6. What is innovative about your project?','What should I include in the project innovation section?','<p>You should show how your project will:</p><ul class=\"list-bullet\">         <li>push boundaries beyond current leading-edge science and technology</li><li>apply existing technologies in new areas</li></ul><p>Explain the novelty of the research in an industrial and/or academic context.</p><p>You should provide evidence that your proposed work is innovative. This could include patent search results, competitor analyses or literature surveys. If relevant, you should also outline your own intellectual property rights.</p>',0,52,'APPLICATION','',NULL),(219,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support your response to this question. This appendix may include graphics describing the innovation or the nature of the problem. You may want to include evidence of freedom to operate, patent searches or competitor analysis as supporting information.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 5 sides of A4. Longer appendices will only have the first 5 pages assessed</li><li>be less than 1mb in size</li></ul>',0,52,'APPLICATION','','PDF'),(220,NULL,23,2,0,'Question score',NULL,NULL,0,52,'ASSESSMENT','',NULL),(221,100,2,2,0,'Feedback','Guidance for assessing innovation','Your score should be based upon the following:',1,52,'ASSESSMENT','',NULL),(222,400,2,2,1,'7. What are the risks (technical, commercial and environmental) to your project\'s success? What is your risk management strategy?','What should I include in the project risks section?','<p>Please describe your plans for limiting and managing risk. You need to:</p><ul class=\"list-bullet\">         <li>identify the project\'s main risks and uncertainties</li><li>detail specific technical, commercial, managerial and environmental risks</li><li>list any other uncertainties such as ethical issues associated with the project</li><li>provide a detailed risk analysis</li><li>rate the main risks as high, medium or low</li><li>show how you\'ll limit the main risks</li><li>identify the project management resources you\'ll use to minimise operational risk</li><li>include arrangements for managing the project team and its partners</li></ul>',0,53,'APPLICATION','',NULL),(223,NULL,23,2,0,'Question score',NULL,NULL,0,53,'ASSESSMENT','',NULL),(224,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,53,'APPLICATION','\0','PDF'),(225,100,2,2,0,'Feedback','Guidance for assessing risks','Your score should be based upon the following:',1,53,'ASSESSMENT','',NULL),(226,400,2,2,1,'8. Does your project team have the skills, experience and facilities to deliver this project?','What should I include in the project skills section?','<p>You should show your project team:</p><ul class=\"list-bullet\"><li>has the right mix of skills and experience to complete the project</li><li>has clear objectives</li><li>would have been formed even without Innovate UK investment</li></ul><p>If you are part of a consortium, describe the benefits of the collaboration, for example, increased knowledge transfer.</p>',0,54,'APPLICATION','',NULL),(227,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to provide details of the specific expertise and track record of each project partner and each subcontractor. Academic collaborators may refer to their research standing.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>include up to half an A4 page per partner describing the skills and experience of the main people who will be working on the project</li><li>be less than 1mb in size</li></ul>',0,54,'APPLICATION','','PDF'),(228,NULL,23,2,0,'Question score',NULL,NULL,0,54,'ASSESSMENT','',NULL),(229,100,2,2,0,'Feedback','Guidance for assessing team skills','Your score should be based upon the following:',1,54,'ASSESSMENT','',NULL),(230,400,2,2,1,'9. What will your project cost?','What should I include in the project cost section?','<p>You must:</p><ul class=\"list-bullet\"><li>show how your budget is realistic for the scale and complexity of the project</li><li>make sure the funding you need from Innovate UK is within the limit set by this competition</li><li>justify any significant costs in the project, such as subcontractors</li><li>show how much funding there will be from other sources</li><li>provide a realistic budget breakdown</li><li>describe and justify individual work packages</li></ul><p>Find out which <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs are eligible.</a></p><p>If your project spans more than one type of research category, you must break down the costs as separate \'work packages\'. For example, industrial research or experimental development. </p><p>You can find more information in the  <a href=\"https://www.gov.uk/guidance/innovate-uk-funding-general-guidance-for-applicants#funding-rules\">funding rules section</a> of this website.</p>',0,55,'APPLICATION','',NULL),(231,NULL,23,2,0,'Question score',NULL,NULL,0,55,'ASSESSMENT','',NULL),(232,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,55,'APPLICATION','\0','PDF'),(233,100,2,2,0,'Feedback','Guidance for assessing project costs','Your score should be based upon the following:',1,55,'ASSESSMENT','',NULL),(234,400,2,2,1,'10. How does financial support from Innovate UK and its funding partners add value?','What should I include in the financial support from Innovate UK section?','Justify why you\'re unable to fund the project yourself from commercial resources. Explain the difference this funding will make to your project. For example, will it lower the risk for you or speed up the process of getting your product to market? Tell us why this will benefit the UK.',0,56,'APPLICATION','',NULL),(235,NULL,23,2,0,'Question score',NULL,NULL,0,56,'ASSESSMENT','',NULL),(236,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,56,'APPLICATION','\0','PDF'),(237,100,2,2,0,'Feedback','Guidance for assessing added value','Your score should be based upon the following:',1,56,'ASSESSMENT','',NULL),(238,NULL,15,2,1,NULL,'','',0,57,'APPLICATION','',NULL),(239,NULL,19,2,1,'Size',NULL,NULL,0,58,'APPLICATION','',NULL),(240,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,58,'APPLICATION','\0','PDF'),(241,NULL,24,2,0,'Turnover (£)','Your turnover from the last financial year.','',1,58,'APPLICATION','',NULL),(242,NULL,25,2,0,'Full time employees','Number of full time employees at your organisation.','',2,58,'APPLICATION','',NULL),(243,NULL,26,2,0,'End of last financial year','Enter the date of your last financial year.','',3,58,'APPLICATION','\0',NULL),(244,NULL,27,2,0,'Annual turnover','','',4,58,'APPLICATION','\0',NULL),(245,NULL,27,2,0,'Annual profits','','',5,58,'APPLICATION','\0',NULL),(246,NULL,27,2,0,'Annual export','','',6,58,'APPLICATION','\0',NULL),(247,NULL,27,2,0,'Research and development spend','','',7,58,'APPLICATION','\0',NULL),(248,NULL,28,2,0,'Full time employees','How many full-time employees did you have on the project at the close of your last financial year?','',8,58,'APPLICATION','\0',NULL),(249,NULL,17,2,1,'Other funding','What should I include in other funding?','<p>You do not need to include completed grants that were used to reach this point in the development process.</p>',0,59,'APPLICATION','',NULL),(250,NULL,7,2,1,'Please enter the grant % you wish to claim for this project','What funding level should I enter?','<p>For a business or academic organisation, you can apply for any funding percentage between 0% and the maximum allowable for your organisation size. For other organisation types, you can apply for any funding percentage between 0% and 100%. The amount you apply for must reflect other funding you may have received. It must also be within participation levels which you can review on the Finances Overview page.</p>',0,60,'APPLICATION','',NULL),(251,NULL,20,2,1,'Upload a pdf copy of the Je-S output form once you have a status of \'With Council\'.',NULL,NULL,0,61,'APPLICATION','',NULL),(252,NULL,6,2,1,NULL,'Labour costs guidance','<p>You can include the following labour costs, based upon your PAYE records:</p><ul class=\"list-bullet\"><li>gross salary</li><li>National Insurance</li><li>company pension contribution</li><li>life insurance</li><li>other non-discretionary package costs.</li></ul><p>You can\'t include:</p><ul class=\"list-bullet\"><li>discretionary bonuses</li><li>performance related payments of any kind</li></ul><p>You may include the total number of working days for staff but do not include:</p><ul class=\"list-bullet\"><li>sick days</li><li>waiting time</li><li>training days</li><li>non-productive time</li></ul><p>Enter the total number of working days in the year. List the total days worked by all categories of staff on your project. Describe their role.</p><p>We will review the total amount of time and cost of labour before we approve your application. The terms and conditions of the grant include compliance with these points.</p>',0,62,'APPLICATION','',NULL),(253,NULL,8,2,1,'Labour',NULL,NULL,0,63,'APPLICATION','',NULL),(254,NULL,6,2,1,NULL,'Overheads costs guidance','<p>If you wish to claim overheads, there are 2 options available to you:</p><p>Option 1: 20% overhead option. This allows you to claim 20% of your labour costs as overhead. No further documentation is needed.</p><p>Option2: Calculate overheads. This allows you to calculate direct and indirect overheads using our overhead spreadsheet. The overhead value claimed under this method will be subject to review if your application is successful. This is in order to assess the appropriateness of the overhead value you are claiming.</p>',0,64,'APPLICATION','',NULL),(255,NULL,9,2,1,'Overheads',NULL,NULL,0,65,'APPLICATION','',NULL),(256,NULL,6,2,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,66,'APPLICATION','',NULL),(257,NULL,10,2,1,'Materials',NULL,NULL,0,67,'APPLICATION','',NULL),(258,NULL,6,2,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,68,'APPLICATION','',NULL),(259,NULL,11,2,1,'Capital Usage',NULL,NULL,0,69,'APPLICATION','',NULL),(260,NULL,6,2,1,NULL,'Subcontracting costs guidance','<p>Subcontracting costs relate to work carried out by third party organisations. These organisations are not part of your project.</p><p>Subcontracting is eligible providing it’s justified as to why the work cannot be performed by a project partner.</p><p>Subcontracting associate companies should be charged at cost.</p><p>Where possible you should select a UK based contractor. You should name the subcontractor (where known) and describe what they will be doing. You should also state where the work will be undertaken. We will look at the size of this contribution when assessing your eligibility and level of support.</p>',0,70,'APPLICATION','',NULL),(261,NULL,12,2,1,'Sub-contracting costs',NULL,NULL,0,71,'APPLICATION','',NULL),(262,NULL,6,2,1,NULL,NULL,NULL,0,72,'APPLICATION','',NULL),(263,NULL,13,2,1,'Travel and subsistence',NULL,NULL,0,73,'APPLICATION','',NULL),(264,NULL,6,2,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Workshop/laboratory usage charges:</strong> direct costs which relate to workshops or laboratories and which can be supported with actual usage data can be claimed. You should provide details of how the workshop/laboratory charge out rates per hour or day are calculated. This can include specific labour, rent, rates, maintenance, equipment, calibration costs, etc. These should form the overall costs together with the available operational hours to form the hourly or daily charge out rates.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for new IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,74,'APPLICATION','',NULL),(265,NULL,14,2,1,'Other costs',NULL,NULL,0,75,'APPLICATION','',NULL),(266,NULL,16,2,1,NULL,NULL,NULL,0,76,'APPLICATION','',NULL),(267,NULL,6,2,1,NULL,NULL,NULL,0,77,'APPLICATION','',NULL),(268,NULL,5,3,1,'Application details',NULL,NULL,0,78,'APPLICATION','',NULL),(269,400,2,3,1,'Project summary','What should I include in the project summary?','<p>We will not score this summary, but it will give the assessors a useful introduction to your project. It should provide a clear overview of the whole project, including:</p> <ul class=\"list-bullet\">         <li>your vision for the project</li><li>key objectives</li><li>main areas of focus</li><li>details of how it is innovative</li></ul>',0,79,'APPLICATION','',NULL),(270,400,2,3,1,'Public description','What should I include in the project public description?','<p>Innovate UK publishes information about projects we have funded. This is in line with government practice on openness and transparency of public-funded activities.</p><p>Describe your project in a way that will be easy for a non-specialist to understand. Don\'t include any information that is confidential, for example, intellectual property or patent details.</p> ',0,80,'APPLICATION','',NULL),(271,400,2,3,1,'How does your project align with the scope of this competition?','What should I include in the project scope?','<p>It is important that you read the following guidance.</p><p>To show how your project aligns with the scope of this competition, you need to:</p><ul class=\"list-bullet\">         <li>read the competition brief in full</li><li>understand the background, challenge and scope of the competition</li><li>address the research objectives in your application</li><li>match your project\'s objectives and activities to these</li></ul> <p>Once you have submitted your application, you should not change this section unless:</p><ul class=\"list-bullet\">         <li>we ask you to provide more information</li><li>we ask you to make it clearer</li></ul> ',0,81,'APPLICATION','',NULL),(272,NULL,21,3,0,'Please select the research category for this project',NULL,NULL,0,81,'ASSESSMENT','',NULL),(273,NULL,22,3,0,'Is the application in scope?',NULL,NULL,1,81,'ASSESSMENT','',NULL),(274,100,2,3,0,'Feedback','Guidance for assessing scope','You should still assess this application even if you think that it is not in scope. Your answer should be based upon the following:',2,81,'ASSESSMENT','',NULL),(275,400,2,3,1,'','What should I include in the need or challenge section?','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">the main motivation for the project; the business need, technological challenge or market opportunity</li><li class=\"li2\">the nearest current state-of-the-art (including those near-market/in development) and its limitations</li><li class=\"li2\">any work you have already done to respond to this need, for example is the project focused on developing an existing capability or building a new one?</li><li class=\"li2\">the wider economic, social, environmental, cultural and/or political challenges which are influential in creating the opportunity (for example, incoming regulations). Our Horizons tool can help here: http://www.slideshare.net/WebadminTSB/innovate-uk-horizons-sustainable-economy-framework</li></ul>',0,82,'APPLICATION','',NULL),(276,NULL,23,3,0,'Question score',NULL,NULL,0,82,'ASSESSMENT','',NULL),(277,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,82,'APPLICATION','\0','PDF'),(278,100,2,3,0,'Feedback','Guidance for assessing need or challenge','Your score should be based upon the following:',1,82,'ASSESSMENT','',NULL),(279,400,2,3,1,'2. What is the size of the potential market for your project?','What should I include in the approach and innovation section?','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">how you will respond to the need, challenge or opportunity identified</li><li class=\"li2\">how you will improve on the nearest current state-of-the-art identified</li><li class=\"li2\">where the focus of the innovation will be in the project (application of existing technologies in new areas, development of new technologies for existing areas or a totally disruptive approach) and the freedom you have to operate</li><li class=\"li2\">how this project fits with your current product/service lines/offerings</li><li class=\"li2\">how it will make you more competitive</li><li class=\"li2\">the nature of the outputs you expect from the project (for example, report, demonstrator, know-how, new process, product or service design) and how these will help you to target the need, challenge or opportunity identified</li></ul>',0,83,'APPLICATION','',NULL),(280,NULL,23,3,0,'Question score',NULL,NULL,0,83,'ASSESSMENT','',NULL),(281,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You can submit up to 2 pages in PDF format no larger than 1MB. This can provide graphics, diagrams or an image to explain your innovation.</p>',1,83,'APPLICATION','','PDF'),(282,100,2,3,0,'Feedback','Guidance for assessing approach and innovation','Your score should be based upon the following:',1,83,'ASSESSMENT','',NULL),(283,400,2,3,1,'3. How will you exploit and market your project?','What should I include in the team and resources section?','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">the roles, skills and relevant experience of all members of the project team in relation to the approach you will be taking</li><li class=\"li2\">the resources, equipment and facilities needed for the project and how you will access them</li><li class=\"li2\">details of any vital external parties, including sub-contractors, who you will need to work with to successfully carry out the project</li><li class=\"li2\">(if collaborative) the current relationships between project partners and how these will change as a result of the project</li><li class=\"li2\">highlight any gaps in the team that will need to be filled</li></ul>',0,84,'APPLICATION','',NULL),(284,NULL,23,3,0,'Question score',NULL,NULL,0,84,'ASSESSMENT','',NULL),(285,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You can submit up to 4 pages in PDF format no larger than 1MB. This can describe the skills and experience of the main people working on the project.</p>',1,84,'APPLICATION','','PDF'),(286,100,2,3,0,'Feedback','Guidance for assessing team and resources','Your score should be based upon the following:',1,84,'ASSESSMENT','',NULL),(287,400,2,3,1,'','What should I include in the market awareness section? ','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">the markets (domestic and/or international) you will be targeting in the project and any other potential markets</li><li class=\"li2\">for the target markets, describe:</li><ul><li class=\"li2\">the size of the target markets for the project outcomes, backed up by references where available</li><li class=\"li2\">the structure and dynamics of the market (such as customer segmentation), together with predicted growth rates within clear timeframes</li><li class=\"li2\">the main supply/value chains and business models in operation (and any barriers to entry)</li><li class=\"li2\">the current UK position in targeting this market</li></ul><li class=\"li2\">for highly innovative projects, where the market may be unexplored, explain:</li><ul><li class=\"li2\">what the route to market could or might be</li><li class=\"li2\">what its size might be</li><li class=\"li2\">how the project will look to explore the market potential</li></ul><li class=\"li2\">briefly describe the size and main features of any other markets not already listed</li></ul>',0,85,'APPLICATION','',NULL),(288,NULL,23,3,0,'Question score',NULL,NULL,0,85,'ASSESSMENT','',NULL),(289,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,85,'APPLICATION','\0','PDF'),(290,100,2,3,0,'Feedback','Guidance for assessing market awareness','Your score should be based upon the following:',1,85,'ASSESSMENT','',NULL),(291,400,2,3,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the outcomes and route to market section?','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">your current position in the markets and supply/value chains outlined (will you be extending or establishing your market position?)</li><li class=\"li2\">your target customers and/or end users, and the value to them (why would they use/buy it?)</li><li class=\"li2\">your route to market</li><li class=\"li2\">how you are going to profit from the innovation (increased revenues or cost reduction)</li><li class=\"li2\">how the innovation will impact your productivity and growth (in the short and long-term)</li><li class=\"li2\">how you will protect and exploit the outputs of the project, for example through know-how, patenting, designs, changes to business model</li><li class=\"li2\">your strategy for targeting the other markets identified during or after the project</li><li class=\"li2\">for any research organisation activity in the project, describe your plans to spread project research outputs over a reasonable timescale</li><li class=\"li2\">if you expect to use the results generated from the project in further research activities, describe how</li></ul>',0,86,'APPLICATION','',NULL),(292,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',0,86,'APPLICATION','\0','PDF'),(293,NULL,23,3,0,'Question score',NULL,NULL,0,86,'ASSESSMENT','',NULL),(294,100,2,3,0,'Feedback','Guidance for assessing outcomes and route to market','Your score should be based upon the following:',1,86,'ASSESSMENT','',NULL),(295,400,2,3,1,'','What should I include in the wider impacts section?','<p class=\"p1\">You should describe and where possible measure:</p><ul><li class=\"li2\">the economic benefits from the project to external parties (customers, others in the supply chain, broader industry and the UK economy) such as productivity increases and import substitution</li><li class=\"li2\">any expected social impacts, either positive or negative on, for example:</li><ul><li class=\"li2\">quality of life</li><li class=\"li2\">social inclusion/exclusion</li><li class=\"li2\">jobs (safeguarded, created, changed, displaced)</li><li class=\"li2\">education</li><li class=\"li2\">public empowerment</li><li class=\"li2\">health and safety</li><li class=\"li2\">regulations</li><li class=\"li2\">diversity</li></ul><li class=\"li2\">any expected impact on government priorities</li><li class=\"li2\">any expected environmental impacts, either positive or negative</li><li class=\"li2\">identify any expected regional impacts of the project</li></ul>',0,87,'APPLICATION','',NULL),(296,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support your response to this question. This appendix may include graphics describing the innovation or the nature of the problem. You may want to include evidence of freedom to operate, patent searches or competitor analysis as supporting information.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 5 sides of A4. Longer appendices will only have the first 5 pages assessed</li><li>be less than 1mb in size</li></ul>',0,87,'APPLICATION','\0','PDF'),(297,NULL,23,3,0,'Question score',NULL,NULL,0,87,'ASSESSMENT','',NULL),(298,100,2,3,0,'Feedback','Guidance for assessing wider impacts','Your score should be based upon the following:',1,87,'ASSESSMENT','',NULL),(299,400,2,3,1,'7. What are the risks (technical, commercial and environmental) to your project\'s success? What is your risk management strategy?','What should I include in the project management section?','<p>You should describe or explain:</p>\r\n<ul>\r\n <li class=\"li2\">the main work packages of the project, indicating the relevant research category, the lead partner assigned to each and the total cost of each one</li>\r\n <li class=\"li2\">your approach to project management, identifying any major tools and mechanisms that will be used for a successful and innovative project outcome.</li>\r\n <li class=\"li2\">the management reporting lines</li>\r\n <li class=\"li2\">your project plan in enough detail to identify any links or dependencies between work packages or milestones</li>\r\n</ul>',0,88,'APPLICATION','',NULL),(300,NULL,23,3,0,'Question score',NULL,NULL,0,88,'ASSESSMENT','',NULL),(301,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You can submit a project plan or Gantt chart of up to 2 pages in PDF format no larger than 1MB.</p>',1,88,'APPLICATION','','PDF'),(302,100,2,3,0,'Feedback','Guidance for project management','Your score should be based upon the following:',1,88,'ASSESSMENT','',NULL),(303,400,2,3,1,'8. Does your project team have the skills, experience and facilities to deliver this project?','What should I include in the risks section?','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">the main risks and uncertainties of the project, including the technical, commercial, managerial and environmental risks, (providing a risk register if appropriate)</li><li class=\"li2\">how will these risks be mitigated</li><li class=\"li2\">any project inputs that are critical to completion (such as resources, expertise, data sets)</li><li class=\"li2\">any output likely to be subject to regulatory requirements, certification, ethical issues, etc, and how will you manage this?</li></ul>',0,89,'APPLICATION','',NULL),(304,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You can submit a risk register of up to 2 pages in PDF format no larger than 1MB.</p>',0,89,'APPLICATION','','PDF'),(305,NULL,23,3,0,'Question score',NULL,NULL,0,89,'ASSESSMENT','',NULL),(306,100,2,3,0,'Feedback','Guidance for assessing risks','Your score should be based upon the following:',1,89,'ASSESSMENT','',NULL),(307,400,2,3,1,'9. What will your project cost?','What should I include in the additionality section?','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">if this project could go ahead in any form without public funding and if so, the difference the public funding would make (such as faster to market, more partners and reduced risk)</li><li class=\"li2\">the likely impact of the project on the business of the partners involved</li><li class=\"li2\">why you are not able to wholly fund the project from your own resources or other forms of private-sector funding (what would happen if the application is unsuccessful)</li><li class=\"li2\">how this project would change the nature of R&amp;D activity the partners would undertake (and related spend)</li></ul>',0,90,'APPLICATION','',NULL),(308,NULL,23,3,0,'Question score',NULL,NULL,0,90,'ASSESSMENT','',NULL),(309,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,90,'APPLICATION','\0','PDF'),(310,100,2,3,0,'Feedback','Guidance for assessing additionality','Your score should be based upon the following:',1,90,'ASSESSMENT','',NULL),(311,400,2,3,1,'10. How does financial support from Innovate UK and its funding partners add value?','What should I include in the costs and value for money section?','<p>You should describe or explain:</p>\r\n<ul>\r\n <li class=\"li2\">the total project cost and the grant being requested in terms of the project goals</li>\r\n <li class=\"li2\">how the partners will finance their contributions to the project</li>\r\n <li class=\"li2\">how this project represents value for money for you and the taxpayer and how it compares to what you would spend your money on otherwise?</li>\r\n <li class=\"li2\">the balance of costs and grant across the project partners</li>\r\n <li class=\"li2\">any sub-contractor costs and why they are critical to the project</li>\r\n</ul>',0,91,'APPLICATION','',NULL),(312,NULL,23,3,0,'Question score',NULL,NULL,0,91,'ASSESSMENT','',NULL),(313,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,91,'APPLICATION','\0','PDF'),(314,100,2,3,0,'Feedback','Guidance for assessing costs and value for money','Your score should be based upon the following:',1,91,'ASSESSMENT','',NULL),(315,NULL,15,3,1,NULL,'','',0,92,'APPLICATION','',NULL),(316,NULL,19,3,1,'Size',NULL,NULL,0,93,'APPLICATION','',NULL),(317,NULL,4,3,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,93,'APPLICATION','\0','PDF'),(318,NULL,24,3,0,'Turnover (£)','Your turnover from the last financial year.','',1,93,'APPLICATION','\0',NULL),(319,NULL,25,3,0,'Full time employees','Number of full time employees at your organisation.','',2,93,'APPLICATION','\0',NULL),(320,NULL,26,3,0,'End of last financial year','Enter the date of your last financial year.','',3,93,'APPLICATION','',NULL),(321,NULL,27,3,0,'Annual turnover','','',4,93,'APPLICATION','',NULL),(322,NULL,27,3,0,'Annual profits','','',5,93,'APPLICATION','',NULL),(323,NULL,27,3,0,'Annual export','','',6,93,'APPLICATION','',NULL),(324,NULL,27,3,0,'Research and development spend','','',7,93,'APPLICATION','',NULL),(325,NULL,28,3,0,'Full time employees','How many full-time employees did you have on the project at the close of your last financial year?','',8,93,'APPLICATION','',NULL),(326,NULL,17,3,1,'Other funding','What should I include in other funding?','<p>You do not need to include completed grants that were used to reach this point in the development process.</p>',0,94,'APPLICATION','',NULL),(327,NULL,7,3,1,'Please enter the grant % you wish to claim for this project','What funding level should I enter?','<p>For a business or academic organisation, you can apply for any funding percentage between 0% and the maximum allowable for your organisation size. For other organisation types, you can apply for any funding percentage between 0% and 100%. The amount you apply for must reflect other funding you may have received. It must also be within participation levels which you can review on the Finances Overview page.</p>',0,95,'APPLICATION','',NULL),(328,NULL,20,3,1,'Upload a pdf copy of the Je-S output form once you have a status of \'With Council\'.',NULL,NULL,0,96,'APPLICATION','',NULL),(329,NULL,6,3,1,NULL,'Labour costs guidance','<p>You can include the following labour costs, based upon your PAYE records:</p><ul class=\"list-bullet\"><li>gross salary</li><li>National Insurance</li><li>company pension contribution</li><li>life insurance</li><li>other non-discretionary package costs.</li></ul><p>You can\'t include:</p><ul class=\"list-bullet\"><li>discretionary bonuses</li><li>performance related payments of any kind</li></ul><p>You may include the total number of working days for staff but do not include:</p><ul class=\"list-bullet\"><li>sick days</li><li>waiting time</li><li>training days</li><li>non-productive time</li></ul><p>Enter the total number of working days in the year. List the total days worked by all categories of staff on your project. Describe their role.</p><p>We will review the total amount of time and cost of labour before we approve your application. The terms and conditions of the grant include compliance with these points.</p>',0,97,'APPLICATION','',NULL),(330,NULL,8,3,1,'Labour',NULL,NULL,0,98,'APPLICATION','',NULL),(331,NULL,6,3,1,NULL,'Overheads costs guidance','<p>If you wish to claim overheads, there are 2 options available to you:</p><p>Option 1: 20% overhead option. This allows you to claim 20% of your labour costs as overhead. No further documentation is needed.</p><p>Option2: Calculate overheads. This allows you to calculate direct and indirect overheads using our overhead spreadsheet. The overhead value claimed under this method will be subject to review if your application is successful. This is in order to assess the appropriateness of the overhead value you are claiming.</p>',0,99,'APPLICATION','',NULL),(332,NULL,9,3,1,'Overheads',NULL,NULL,0,100,'APPLICATION','',NULL),(333,NULL,6,3,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,101,'APPLICATION','',NULL),(334,NULL,10,3,1,'Materials',NULL,NULL,0,102,'APPLICATION','',NULL),(335,NULL,6,3,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,103,'APPLICATION','',NULL),(336,NULL,11,3,1,'Capital Usage',NULL,NULL,0,104,'APPLICATION','',NULL),(337,NULL,6,3,1,NULL,'Subcontracting costs guidance','<p>Subcontracting costs relate to work carried out by third party organisations. These organisations are not part of your project.</p><p>Subcontracting is eligible providing it’s justified as to why the work cannot be performed by a project partner.</p><p>Subcontracting associate companies should be charged at cost.</p><p>Where possible you should select a UK based contractor. You should name the subcontractor (where known) and describe what they will be doing. You should also state where the work will be undertaken. We will look at the size of this contribution when assessing your eligibility and level of support.</p>',0,105,'APPLICATION','',NULL),(338,NULL,12,3,1,'Sub-contracting costs',NULL,NULL,0,106,'APPLICATION','',NULL),(339,NULL,6,3,1,NULL,NULL,NULL,0,107,'APPLICATION','',NULL),(340,NULL,13,3,1,'Travel and subsistence',NULL,NULL,0,108,'APPLICATION','',NULL),(341,NULL,6,3,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Workshop/laboratory usage charges:</strong> direct costs which relate to workshops or laboratories and which can be supported with actual usage data can be claimed. You should provide details of how the workshop/laboratory charge out rates per hour or day are calculated. This can include specific labour, rent, rates, maintenance, equipment, calibration costs, etc. These should form the overall costs together with the available operational hours to form the hourly or daily charge out rates.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for new IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,109,'APPLICATION','',NULL),(342,NULL,14,3,1,'Other costs',NULL,NULL,0,110,'APPLICATION','',NULL),(343,NULL,16,3,1,NULL,NULL,NULL,0,111,'APPLICATION','',NULL),(344,NULL,6,3,1,NULL,NULL,NULL,0,112,'APPLICATION','',NULL),(345,NULL,5,4,1,'Application details',NULL,NULL,0,113,'APPLICATION','',NULL),(346,400,2,4,1,'Project summary','What should I include in the project summary?','<p>We will not score this summary, but it will give the assessors a useful introduction to your project. It should provide a clear overview of the whole project, including:</p> <ul class=\"list-bullet\">         <li>your vision for the project</li><li>key objectives</li><li>main areas of focus</li><li>details of how it is innovative</li></ul>',0,114,'APPLICATION','',NULL),(347,400,2,4,1,'Public description','What should I include in the project public description?','<p>Innovate UK publishes information about projects we have funded. This is in line with government practice on openness and transparency of public-funded activities.</p><p>Describe your project in a way that will be easy for a non-specialist to understand. Don\'t include any information that is confidential, for example, intellectual property or patent details.</p> ',0,115,'APPLICATION','',NULL),(348,400,2,4,1,'How does your project align with the scope of this competition?','What should I include in the project scope?','<p>It is important that you read the following guidance.</p><p>To show how your project aligns with the scope of this competition, you need to:</p><ul class=\"list-bullet\">         <li>read the competition brief in full</li><li>understand the background, challenge and scope of the competition</li><li>address the research objectives in your application</li><li>match your project\'s objectives and activities to these</li></ul> <p>Once you have submitted your application, you should not change this section unless:</p><ul class=\"list-bullet\">         <li>we ask you to provide more information</li><li>we ask you to make it clearer</li></ul> ',0,116,'APPLICATION','',NULL),(349,NULL,21,4,0,'Please select the research category for this project',NULL,NULL,0,116,'ASSESSMENT','',NULL),(350,NULL,22,4,0,'Is the application in scope?',NULL,NULL,1,116,'ASSESSMENT','',NULL),(351,100,2,4,0,'Feedback','Guidance for assessing scope','Your answer should be based upon the following:',2,116,'ASSESSMENT','',NULL),(376,NULL,15,4,1,NULL,'','',0,123,'APPLICATION','',NULL),(377,NULL,19,4,1,'Size',NULL,NULL,0,124,'APPLICATION','',NULL),(378,NULL,4,4,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,124,'APPLICATION','\0','PDF'),(379,NULL,24,4,0,'Turnover (£)','Your turnover from the last financial year.','',1,124,'APPLICATION','',NULL),(380,NULL,25,4,0,'Full time employees','Number of full time employees at your organisation.','',2,124,'APPLICATION','',NULL),(381,NULL,26,4,0,'End of last financial year','Enter the date of your last financial year.','',3,124,'APPLICATION','\0',NULL),(382,NULL,27,4,0,'Annual turnover','','',4,124,'APPLICATION','\0',NULL),(383,NULL,27,4,0,'Annual profits','','',5,124,'APPLICATION','\0',NULL),(384,NULL,27,4,0,'Annual export','','',6,124,'APPLICATION','\0',NULL),(385,NULL,27,4,0,'Research and development spend','','',7,124,'APPLICATION','\0',NULL),(386,NULL,28,4,0,'Full time employees','How many full-time employees did you have on the project at the close of your last financial year?','',8,124,'APPLICATION','\0',NULL),(387,NULL,17,4,1,'Other funding','What should I include in the other public funding section?','<p>You must provide details of other public funding that you are currently applying for (or have already applied for) in relation to this project. You do not need to include completed grants that were used to reach this point in the development process. This information is important as other public sector support counts as part of the funding you can receive for your project.</p>',0,125,'APPLICATION','',NULL),(388,NULL,7,4,1,'Please enter the grant % you wish to claim for this project','What funding level should I enter?','<p>For a business or academic organisation, you can apply for any funding percentage between 0% and the maximum allowable for your organisation size. For other organisation types, you can apply for any funding percentage between 0% and 100%. The amount you apply for must reflect other funding you may have received. It must also be within participation levels which you can review on the Finances Overview page.</p>',0,126,'APPLICATION','',NULL),(389,NULL,20,4,1,'Upload a pdf copy of the Je-S output form once you have a status of \'With Council\'.',NULL,NULL,0,127,'APPLICATION','',NULL),(390,NULL,6,4,1,NULL,'Labour costs guidance','<p>You can include the following labour costs, based upon your PAYE records:</p><ul class=\"list-bullet\"><li>gross salary</li><li>National Insurance</li><li>company pension contribution</li><li>life insurance</li><li>other non-discretionary package costs.</li></ul><p>You can\'t include:</p><ul class=\"list-bullet\"><li>discretionary bonuses</li><li>performance related payments of any kind</li></ul><p>You may include the total number of working days for staff but do not include:</p><ul class=\"list-bullet\"><li>sick days</li><li>waiting time</li><li>training days</li><li>non-productive time</li></ul><p>Enter the total number of working days in the year. List the total days worked by all categories of staff on your project. Describe their role.</p><p>We will review the total amount of time and cost of labour before we approve your application. The terms and conditions of the grant include compliance with these points.</p>',0,128,'APPLICATION','',NULL),(391,NULL,8,4,1,'Labour',NULL,NULL,0,129,'APPLICATION','',NULL),(392,NULL,6,4,1,NULL,NULL,NULL,0,130,'APPLICATION','',NULL),(393,NULL,9,4,1,'Overheads',NULL,NULL,0,131,'APPLICATION','',NULL),(394,NULL,6,4,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,132,'APPLICATION','',NULL),(395,NULL,10,4,1,'Materials',NULL,NULL,0,133,'APPLICATION','',NULL),(396,NULL,6,4,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its Net Present Value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,134,'APPLICATION','',NULL),(397,NULL,11,4,1,'Capital Usage',NULL,NULL,0,135,'APPLICATION','',NULL),(398,NULL,6,4,1,NULL,'Subcontracting costs guidance','<p>Subcontracting costs relate to work carried out by third party organisations. These organisations are not part of your project or collaboration.</p><p>Subcontracting is eligible providing it’s justified as to why the work cannot be performed by a project partner.</p><p>Where possible you should select a UK based contractor. You should name the subcontractor (where known) and describe what they will be doing. You should also state where the work will be undertaken. We will look at the size of this contribution when assessing your eligibility and level of support.</p>',0,136,'APPLICATION','',NULL),(399,NULL,12,4,1,'Sub-contracting costs',NULL,NULL,0,137,'APPLICATION','',NULL),(400,NULL,6,4,1,NULL,NULL,NULL,0,138,'APPLICATION','',NULL),(401,NULL,13,4,1,'Travel and subsistence',NULL,NULL,0,139,'APPLICATION','',NULL),(402,NULL,6,4,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for New IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,140,'APPLICATION','',NULL),(403,NULL,14,4,1,'Other costs',NULL,NULL,0,141,'APPLICATION','',NULL),(404,NULL,16,4,1,NULL,NULL,NULL,0,142,'APPLICATION','',NULL),(405,NULL,6,4,1,NULL,NULL,NULL,0,143,'APPLICATION','',NULL),(406,400,2,4,1,NULL,NULL,NULL,0,144,'APPLICATION','',NULL),(407,NULL,23,4,0,'Question score',NULL,NULL,0,144,'ASSESSMENT','',NULL),(408,NULL,4,4,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,14