g:',1,149,'ASSESSMENT','',NULL),(424,400,2,5,1,'3. Who is in the project team and what are their roles?','What should I include in the project team section?','<p>Describe or give:</p><ul class=\"list-bullet\">         <li>the roles, skills and relevant experience of all members of the project team</li><li>the resources, equipment and facilities required for your project, and how you will access them</li><li>details of any external parties, including sub-contractors, you will need</li></ul>',0,150,'APPLICATION','',NULL),(425,NULL,23,5,0,'Question score',NULL,NULL,0,150,'ASSESSMENT','',NULL),(426,NULL,4,5,1,'Appendix','What should I include in the appendix?','<p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,150,'APPLICATION','\0','PDF'),(427,100,2,5,0,'Feedback','Guidance for assessing team skills','Your score should be based upon the following:',1,150,'ASSESSMENT','',NULL),(428,400,2,5,1,'4. How much will your project cost, and how does it represent value for money for your team and the taxpayer?','What should I include in the funding and adding value section?','<p>Tell us:</p><ul class=\"list-bullet\"><li>what you estimate your project will cost in total</li><li>how your project’s goals justify the total project cost and the grant you are requesting</li><li>how your project represents value for money for you, and for the taxpayer</li><li>what you would spend your money on otherwise</li><li>whether your project could go ahead in any form without public funding, and if so, what difference the funding would make, such as speeding up the route to market, attracting more partners or reducing risk</li></ul>',0,151,'APPLICATION','',NULL),(429,NULL,23,5,0,'Question score',NULL,NULL,0,151,'ASSESSMENT','',NULL),(430,NULL,4,5,1,'Appendix','What should I include in the appendix?','<p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,151,'APPLICATION','\0','PDF'),(431,100,2,5,0,'Feedback','Guidance for assessing funding and adding value','Your score should be based upon the following:',1,151,'ASSESSMENT','',NULL),(432,NULL,5,6,1,'Application details',NULL,NULL,0,152,'APPLICATION','',NULL),(433,400,2,6,1,'Project summary','What should I include in the project summary?','<p>We will not score this summary, but it will give the assessors a useful introduction to your project. It should provide a clear overview of the whole project, including:</p> <ul class=\"list-bullet\">         <li>your vision for the project</li><li>key objectives</li><li>main areas of focus</li><li>details of how it is innovative</li></ul>',0,153,'APPLICATION','',NULL),(434,400,2,6,1,'Public description','What should I include in the project public description?','<p>Innovate UK publishes information about projects we have funded. This is in line with government practice on openness and transparency of public-funded activities.</p><p>Describe your project in a way that will be easy for a non-specialist to understand. Don\'t include any information that is confidential, for example, intellectual property or patent details.</p> ',0,154,'APPLICATION','',NULL),(435,400,2,6,1,'How does your project align with the scope of this competition?','What should I include in the project scope?','<p>It is important that you read the following guidance.</p><p>To show how your project aligns with the scope of this competition, you need to:</p><ul class=\"list-bullet\">         <li>read the competition brief in full</li><li>understand the background, challenge and scope of the competition</li><li>address the research objectives in your application</li><li>match your project\'s objectives and activities to these</li></ul> <p>Once you have submitted your application, you should not change this section unless:</p><ul class=\"list-bullet\">         <li>we ask you to provide more information</li><li>we ask you to make it clearer</li></ul> ',0,155,'APPLICATION','',NULL),(436,NULL,21,6,0,'Please select the research category for this project',NULL,NULL,0,155,'ASSESSMENT','',NULL),(437,NULL,22,6,0,'Is the application in scope?',NULL,NULL,1,155,'ASSESSMENT','',NULL),(438,100,2,6,0,'Feedback','Guidance for assessing scope','Your answer should be based upon the following:',2,155,'ASSESSMENT','',NULL),(439,400,2,6,1,'1. What is the business opportunity that your project addresses?','What should I include in the business opportunity section?','<p>You should describe:</p><ul class=\"list-bullet\">         <li>the business opportunity you have identified and how you plan to take advantage of it</li><li>the customer needs you have identified and how your project will meet them</li><li>the challenges you expect to face and how you will overcome them</li></ul>',0,156,'APPLICATION','',NULL),(440,NULL,23,6,0,'Question score',NULL,NULL,0,156,'ASSESSMENT','',NULL),(441,NULL,4,6,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,156,'APPLICATION','\0','PDF'),(442,100,2,6,0,'Feedback','Guidance for assessing business opportunity','Your score should be based upon the following:',1,156,'ASSESSMENT','',NULL),(443,400,2,6,1,'2. What is the size of the potential market for your project?','What should I include in the market opportunity section?','<p>Describe the size of the potential market for your project, including:</p><ul class=\"list-bullet\">         <li>details of your target market, for instance, how competitive and profitable it is</li><li>the current size of the market, with actual and predicted growth rates</li><li>the market share you expect to achieve and the reasons for this estimate</li><li>the wider economic value you expect your project to add to the UK and/or the EEA (European Economic Area)</li></ul><p>Tell us what return on investment you expect your project to achieve. You should base this estimate on relevant industry data and tell us how you have calculated this.</p><p>If you are targeting an undeveloped market, you should also:</p><ul class=\"list-bullet\">         <li>describe how you plan to access this market</li><li>estimate its potential size</li><li>explain how you will explore its potential</li></ul>',0,157,'APPLICATION','',NULL),(444,NULL,23,6,0,'Question score',NULL,NULL,0,157,'ASSESSMENT','',NULL),(445,NULL,4,6,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,157,'APPLICATION','\0','PDF'),(446,100,2,6,0,'Feedback','Guidance for assessing market opportunity','Your score should be based upon the following:',1,157,'ASSESSMENT','',NULL),(447,400,2,6,1,'3. How will you exploit and market your project?','What should I include in the project exploitation section?','<p>Describe the potential outputs of the project, such as:</p><ul class=\"list-bullet\">         <li>products or services</li><li>processes</li><li>applications</li></ul><p>Describe how you will exploit these outputs, such as:</p><ul class=\"list-bullet\">         <li>the route to market</li><li>protection of intellectual property rights</li><li>reconfiguration of your organisation\'s value system</li><li>changes to business models and processes</li><li>any other methods of exploitation and protection</li></ul> ',0,158,'APPLICATION','',NULL),(448,NULL,23,6,0,'Question score',NULL,NULL,0,158,'ASSESSMENT','',NULL),(449,NULL,4,6,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,158,'APPLICATION','\0','PDF'),(450,100,2,6,0,'Feedback','Guidance for assessing project exploitation','Your score should be based upon the following:',1,158,'ASSESSMENT','',NULL),(451,400,2,6,1,'4. What economic, social and environmental benefits do you expect your project to deliver and when?','What should I include in the benefits section?','<p>Describe all the benefits you expect your project to deliver, including:</p><p><strong>Economic</strong> : this is the real impact the project will have on its economic environment. This is not traditional corporate accounting profit and can include cost avoidance. You should identify and quantify any expected benefits to:</p><ul class=\"list-bullet\"><li>users (intermediaries and end users)</li><li>suppliers</li><li>broader industrial markets</li><li>the UK economy</li></ul><p><strong>Social</strong> : quantify any expected social impacts either positive or negative on, for example:</p><ul class=\"list-bullet\"><li>quality of life</li><li>social inclusion/exclusion</li><li>education</li><li>public empowerment</li><li>health and safety</li><li>regulation</li><li>diversity</li><li>government priorities</li></ul><p><strong>Environmental</strong> : show how your project will benefit or have a low impact on the environment. For example, this could include:<p><ul class=\"list-bullet\"><li>careful management of energy consumption</li><li>reductions in carbon emissions</li><li>reducing manufacturing and materials waste</li><li>rendering waste less toxic before disposing of it in a safe and legal manner</li><li>re-manufacturing (cradle to cradle)</li></ul>',0,159,'APPLICATION','',NULL),(452,NULL,23,6,0,'Question score',NULL,NULL,0,159,'ASSESSMENT','',NULL),(453,NULL,4,6,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,159,'APPLICATION','\0','PDF'),(454,100,2,6,0,'Feedback','Guidance for assessing economic benefits','Your score should be based upon the following:',1,159,'ASSESSMENT','',NULL),(455,400,2,6,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the technical approach section?','<p>You should:</p><ul class=\"list-bullet\">         <li>describe your technical approach including the main objectives of the work</li><li>explain how and why your approach is appropriate</li><li>tell us how you will make sure that the innovative steps in your project are achievable</li><li>describe rival technologies and alternative R&D strategies</li><li>explain why your proposed approach will offer a better outcome</li></ul>',0,160,'APPLICATION','',NULL),(456,NULL,4,6,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',0,160,'APPLICATION','','PDF'),(457,NULL,23,6,0,'Question score',NULL,NULL,0,160,'ASSESSMENT','',NULL),(458,100,2,6,0,'Feedback','Guidance for assessing technical approach','Your score should be based upon the following:',1,160,'ASSESSMENT','',NULL),(459,400,2,6,1,'6. What is innovative about your project?','What should I include in the project innovation section?','<p>You should show how your project will:</p><ul class=\"list-bullet\">         <li>push boundaries beyond current leading-edge science and technology</li><li>apply existing technologies in new areas</li></ul><p>Explain the novelty of the research in an industrial and/or academic context.</p><p>You should provide evidence that your proposed work is innovative. This could include patent search results, competitor analyses or literature surveys. If relevant, you should also outline your own intellectual property rights.</p>',0,161,'APPLICATION','',NULL),(460,NULL,4,6,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support your response to this question. This appendix may include graphics describing the innovation or the nature of the problem. You may want to include evidence of freedom to operate, patent searches or competitor analysis as supporting information.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 5 sides of A4. Longer appendices will only have the first 5 pages assessed</li><li>be less than 1mb in size</li></ul>',0,161,'APPLICATION','','PDF'),(461,NULL,23,6,0,'Question score',NULL,NULL,0,161,'ASSESSMENT','',NULL),(462,100,2,6,0,'Feedback','Guidance for assessing innovation','Your score should be based upon the following:',1,161,'ASSESSMENT','',NULL),(463,400,2,2,1,'7. What are the risks (technical, commercial and environmental) to your project\'s success? What is your risk management strategy?','What should I include in the project risks section?','<p>Please describe your plans for limiting and managing risk. You need to:</p><ul class=\"list-bullet\">         <li>identify the project\'s main risks and uncertainties</li><li>detail specific technical, commercial, managerial and environmental risks</li><li>list any other uncertainties such as ethical issues associated with the project</li><li>provide a detailed risk analysis</li><li>rate the main risks as high, medium or low</li><li>show how you\'ll limit the main risks</li><li>identify the project management resources you\'ll use to minimise operational risk</li><li>include arrangements for managing the project team and its partners</li></ul>',0,162,'APPLICATION','',NULL),(464,NULL,23,2,0,'Question score',NULL,NULL,0,162,'ASSESSMENT','',NULL),(465,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,162,'APPLICATION','\0','PDF'),(466,100,2,2,0,'Feedback','Guidance for assessing risks','Your score should be based upon the following:',1,162,'ASSESSMENT','',NULL),(467,400,2,2,1,'8. Does your project team have the skills, experience and facilities to deliver this project?','What should I include in the project skills section?','<p>You should show your project team:</p><ul class=\"list-bullet\"><li>has the right mix of skills and experience to complete the project</li><li>has clear objectives</li><li>would have been formed even without Innovate UK investment</li></ul><p>If you are part of a consortium, describe the benefits of the collaboration, for example, increased knowledge transfer.</p>',0,163,'APPLICATION','',NULL),(468,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to provide details of the specific expertise and track record of each project partner and each subcontractor. Academic collaborators may refer to their research standing.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>include up to half an A4 page per partner describing the skills and experience of the main people who will be working on the project</li><li>be less than 1mb in size</li></ul>',0,163,'APPLICATION','','PDF'),(469,NULL,23,2,0,'Question score',NULL,NULL,0,163,'ASSESSMENT','',NULL),(470,100,2,2,0,'Feedback','Guidance for assessing team skills','Your score should be based upon the following:',1,163,'ASSESSMENT','',NULL),(471,400,2,2,1,'9. What will your project cost?','What should I include in the project cost section?','<p>You must:</p><ul class=\"list-bullet\"><li>show how your budget is realistic for the scale and complexity of the project</li><li>make sure the funding you need from Innovate UK is within the limit set by this competition</li><li>justify any significant costs in the project, such as subcontractors</li><li>show how much funding there will be from other sources</li><li>provide a realistic budget breakdown</li><li>describe and justify individual work packages</li></ul><p>Find out which <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs are eligible.</a></p><p>If your project spans more than one type of research category, you must break down the costs as separate \'work packages\'. For example, industrial research or experimental development. </p><p>You can find more information in the  <a href=\"https://www.gov.uk/guidance/innovate-uk-funding-general-guidance-for-applicants#funding-rules\">funding rules section</a> of this website.</p>',0,164,'APPLICATION','',NULL),(472,NULL,23,2,0,'Question score',NULL,NULL,0,164,'ASSESSMENT','',NULL),(473,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,164,'APPLICATION','\0','PDF'),(474,100,2,2,0,'Feedback','Guidance for assessing financial commitment','Your score should be based upon the following:',1,164,'ASSESSMENT','',NULL),(475,400,2,2,1,'10. How does financial support from Innovate UK and its funding partners add value?','What should I include in the financial support from Innovate UK section?','Justify why you\'re unable to fund the project yourself from commercial resources. Explain the difference this funding will make to your project. For example, will it lower the risk for you or speed up the process of getting your product to market? Tell us why this will benefit the UK.',0,165,'APPLICATION','',NULL),(476,NULL,23,2,0,'Question score',NULL,NULL,0,165,'ASSESSMENT','',NULL),(477,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,165,'APPLICATION','\0','PDF'),(478,100,2,2,0,'Feedback','Guidance for assessing added value','Your score should be based upon the following:',1,165,'ASSESSMENT','',NULL),(479,NULL,15,6,1,NULL,'','',0,166,'APPLICATION','',NULL),(480,NULL,19,6,1,'Size',NULL,NULL,0,167,'APPLICATION','',NULL),(481,NULL,4,6,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,167,'APPLICATION','\0','PDF'),(482,NULL,24,6,0,'Turnover (£)','Your turnover from the last financial year.','',1,167,'APPLICATION','',NULL),(483,NULL,25,6,0,'Full time employees','Number of full time employees at your organisation.','',2,167,'APPLICATION','',NULL),(484,NULL,26,6,0,'End of last financial year','Enter the date of your last financial year.','',3,167,'APPLICATION','\0',NULL),(485,NULL,27,6,0,'Annual turnover','','',4,167,'APPLICATION','\0',NULL),(486,NULL,27,6,0,'Annual profits','','',5,167,'APPLICATION','\0',NULL),(487,NULL,27,6,0,'Annual export','','',6,167,'APPLICATION','\0',NULL),(488,NULL,27,6,0,'Research and development spend','','',7,167,'APPLICATION','\0',NULL),(489,NULL,28,6,0,'Full time employees','How many full-time employees did you have on the project at the close of your last financial year?','',8,167,'APPLICATION','\0',NULL),(490,NULL,17,6,1,'Other funding','What should I include in the other public funding section?','<p>You must provide details of other public funding that you are currently applying for (or have already applied for) in relation to this project. You do not need to include completed grants that were used to reach this point in the development process. This information is important as other public sector support counts as part of the funding you can receive for your project.</p>',0,168,'APPLICATION','',NULL),(491,NULL,7,6,1,'Please enter the grant % you wish to claim for this project','What funding level should I enter?','<p>For a business or academic organisation, you can apply for any funding percentage between 0% and the maximum allowable for your organisation size. For other organisation types, you can apply for any funding percentage between 0% and 100%. The amount you apply for must reflect other funding you may have received. It must also be within participation levels which you can review on the Finances Overview page.</p>',0,169,'APPLICATION','',NULL),(492,NULL,6,6,1,NULL,'Labour costs guidance','<p>You can include the following labour costs, based upon your PAYE records:</p><ul class=\"list-bullet\"><li>gross salary</li><li>National Insurance</li><li>company pension contribution</li><li>life insurance</li><li>other non-discretionary package costs.</li></ul><p>You can\'t include:</p><ul class=\"list-bullet\"><li>discretionary bonuses</li><li>performance related payments of any kind</li></ul><p>You may include the total number of working days for staff but do not include:</p><ul class=\"list-bullet\"><li>sick days</li><li>waiting time</li><li>training days</li><li>non-productive time</li></ul><p>Enter the total number of working days in the year. List the total days worked by all categories of staff on your project. Describe their role.</p><p>We will review the total amount of time and cost of labour before we approve your application. The terms and conditions of the grant include compliance with these points.</p>',0,170,'APPLICATION','',NULL),(493,NULL,8,6,1,'Labour',NULL,NULL,0,171,'APPLICATION','',NULL),(494,NULL,6,6,1,NULL,NULL,NULL,0,172,'APPLICATION','',NULL),(495,NULL,9,6,1,'Overheads',NULL,NULL,0,173,'APPLICATION','',NULL),(496,NULL,6,6,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,174,'APPLICATION','',NULL),(497,NULL,10,6,1,'Materials',NULL,NULL,0,175,'APPLICATION','',NULL),(498,NULL,6,6,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its Net Present Value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,176,'APPLICATION','',NULL),(499,NULL,11,6,1,'Capital Usage',NULL,NULL,0,177,'APPLICATION','',NULL),(500,NULL,6,6,1,NULL,'Subcontracting costs guidance','<p>Subcontracting costs relate to work carried out by third party organisations. These organisations are not part of your project or collaboration.</p><p>Subcontracting is eligible providing it’s justified as to why the work cannot be performed by a project partner.</p><p>Where possible you should select a UK based contractor. You should name the subcontractor (where known) and describe what they will be doing. You should also state where the work will be undertaken. We will look at the size of this contribution when assessing your eligibility and level of support.</p>',0,178,'APPLICATION','',NULL),(501,NULL,12,6,1,'Sub-contracting costs',NULL,NULL,0,179,'APPLICATION','',NULL),(502,NULL,6,6,1,NULL,NULL,NULL,0,180,'APPLICATION','',NULL),(503,NULL,13,6,1,'Travel and subsistence',NULL,NULL,0,181,'APPLICATION','',NULL),(504,NULL,6,6,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for New IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,182,'APPLICATION','',NULL),(505,NULL,14,6,1,'Other costs',NULL,NULL,0,183,'APPLICATION','',NULL),(506,NULL,16,6,1,NULL,NULL,NULL,0,184,'APPLICATION','',NULL),(507,NULL,6,6,1,NULL,NULL,NULL,0,185,'APPLICATION','',NULL),(508,NULL,5,7,1,'Application details',NULL,NULL,0,186,'APPLICATION','',NULL),(509,400,2,7,1,'Project summary','What should I include in the project summary?','<p>We will not score this summary, but it will give the assessors a useful introduction to your project. It should provide a clear overview of the whole project, including:</p> <ul class=\"list-bullet\">         <li>your vision for the project</li><li>key objectives</li><li>main areas of focus</li><li>details of how it is innovative</li></ul>',0,187,'APPLICATION','',NULL),(510,400,2,7,1,'Public description','What should I include in the project public description?','<p>Innovate UK publishes information about projects we have funded. This is in line with government practice on openness and transparency of public-funded activities.</p><p>Describe your project in a way that will be easy for a non-specialist to understand. Don\'t include any information that is confidential, for example, intellectual property or patent details.</p> ',0,188,'APPLICATION','',NULL),(511,400,2,7,1,'How does your project align with the scope of this competition?','What should I include in the project scope?','<p>It is important that you read the following guidance.</p><p>To show how your project aligns with the scope of this competition, you need to:</p><ul class=\"list-bullet\">         <li>read the competition brief in full</li><li>understand the background, challenge and scope of the competition</li><li>address the research objectives in your application</li><li>match your project\'s objectives and activities to these</li></ul> <p>Once you have submitted your application, you should not change this section unless:</p><ul class=\"list-bullet\">         <li>we ask you to provide more information</li><li>we ask you to make it clearer</li></ul> ',0,189,'APPLICATION','',NULL),(512,NULL,21,7,0,'Please select the research category for this project',NULL,NULL,0,189,'ASSESSMENT','',NULL),(513,NULL,22,7,0,'Is the application in scope?',NULL,NULL,1,189,'ASSESSMENT','',NULL),(514,100,2,7,0,'Feedback','Guidance for assessing scope','Your answer should be based upon the following:',2,189,'ASSESSMENT','',NULL),(515,400,2,7,1,'1. What is the business opportunity that your project addresses?','What should I include in the business opportunity section?','<p>You should describe:</p><ul class=\"list-bullet\">         <li>the business opportunity you have identified and how you plan to take advantage of it</li><li>the customer needs you have identified and how your project will meet them</li><li>the challenges you expect to face and how you will overcome them</li></ul>',0,190,'APPLICATION','',NULL),(516,NULL,23,7,0,'Question score',NULL,NULL,0,190,'ASSESSMENT','',NULL),(517,NULL,4,7,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,190,'APPLICATION','\0','PDF'),(518,100,2,7,0,'Feedback','Guidance for assessing business opportunity','Your score should be based upon the following:',1,190,'ASSESSMENT','',NULL),(519,400,2,7,1,'2. What is the size of the potential market for your project?','What should I include in the market opportunity section?','<p>Describe the size of the potential market for your project, including:</p><ul class=\"list-bullet\">         <li>details of your target market, for instance, how competitive and profitable it is</li><li>the current size of the market, with actual and predicted growth rates</li><li>the market share you expect to achieve and the reasons for this estimate</li><li>the wider economic value you expect your project to add to the UK and/or the EEA (European Economic Area)</li></ul><p>Tell us what return on investment you expect your project to achieve. You should base this estimate on relevant industry data and tell us how you have calculated this.</p><p>If you are targeting an undeveloped market, you should also:</p><ul class=\"list-bullet\">         <li>describe how you plan to access this market</li><li>estimate its potential size</li><li>explain how you will explore its potential</li></ul>',0,191,'APPLICATION','',NULL),(520,NULL,23,7,0,'Question score',NULL,NULL,0,191,'ASSESSMENT','',NULL),(521,NULL,4,7,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,191,'APPLICATION','\0','PDF'),(522,100,2,7,0,'Feedback','Guidance for assessing market opportunity','Your score should be based upon the following:',1,191,'ASSESSMENT','',NULL),(523,400,2,7,1,'3. How will you exploit and market your project?','What should I include in the project exploitation section?','<p>Describe the potential outputs of the project, such as:</p><ul class=\"list-bullet\">         <li>products or services</li><li>processes</li><li>applications</li></ul><p>Describe how you will exploit these outputs, such as:</p><ul class=\"list-bullet\">         <li>the route to market</li><li>protection of intellectual property rights</li><li>reconfiguration of your organisation\'s value system</li><li>changes to business models and processes</li><li>any other methods of exploitation and protection</li></ul> ',0,192,'APPLICATION','',NULL),(524,NULL,23,7,0,'Question score',NULL,NULL,0,192,'ASSESSMENT','',NULL),(525,NULL,4,7,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,192,'APPLICATION','\0','PDF'),(526,100,2,7,0,'Feedback','Guidance for assessing project exploitation','Your score should be based upon the following:',1,192,'ASSESSMENT','',NULL),(527,400,2,7,1,'4. What economic, social and environmental benefits do you expect your project to deliver and when?','What should I include in the benefits section?','<p>Describe all the benefits you expect your project to deliver, including:</p><p><strong>Economic</strong> : this is the real impact the project will have on its economic environment. This is not traditional corporate accounting profit and can include cost avoidance. You should identify and quantify any expected benefits to:</p><ul class=\"list-bullet\"><li>users (intermediaries and end users)</li><li>suppliers</li><li>broader industrial markets</li><li>the UK economy</li></ul><p><strong>Social</strong> : quantify any expected social impacts either positive or negative on, for example:</p><ul class=\"list-bullet\"><li>quality of life</li><li>social inclusion/exclusion</li><li>education</li><li>public empowerment</li><li>health and safety</li><li>regulation</li><li>diversity</li><li>government priorities</li></ul><p><strong>Environmental</strong> : show how your project will benefit or have a low impact on the environment. For example, this could include:<p><ul class=\"list-bullet\"><li>careful management of energy consumption</li><li>reductions in carbon emissions</li><li>reducing manufacturing and materials waste</li><li>rendering waste less toxic before disposing of it in a safe and legal manner</li><li>re-manufacturing (cradle to cradle)</li></ul>',0,193,'APPLICATION','',NULL),(528,NULL,23,7,0,'Question score',NULL,NULL,0,193,'ASSESSMENT','',NULL),(529,NULL,4,7,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,193,'APPLICATION','\0','PDF'),(530,100,2,7,0,'Feedback','Guidance for assessing economic benefits','Your score should be based upon the following:',1,193,'ASSESSMENT','',NULL),(531,400,2,7,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the technical approach section?','<p>You should:</p><ul class=\"list-bullet\">         <li>describe your technical approach including the main objectives of the work</li><li>explain how and why your approach is appropriate</li><li>tell us how you will make sure that the innovative steps in your project are achievable</li><li>describe rival technologies and alternative R&D strategies</li><li>explain why your proposed approach will offer a better outcome</li></ul>',0,194,'APPLICATION','',NULL),(532,NULL,4,7,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',0,194,'APPLICATION','','PDF'),(533,NULL,23,7,0,'Question score',NULL,NULL,0,194,'ASSESSMENT','',NULL),(534,100,2,7,0,'Feedback','Guidance for assessing technical approach','Your score should be based upon the following:',1,194,'ASSESSMENT','',NULL),(535,400,2,7,1,'6. What is innovative about your project?','What should I include in the project innovation section?','<p>You should show how your project will:</p><ul class=\"list-bullet\">         <li>push boundaries beyond current leading-edge science and technology</li><li>apply existing technologies in new areas</li></ul><p>Explain the novelty of the research in an industrial and/or academic context.</p><p>You should provide evidence that your proposed work is innovative. This could include patent search results, competitor analyses or literature surveys. If relevant, you should also outline your own intellectual property rights.</p>',0,195,'APPLICATION','',NULL),(536,NULL,4,7,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support your response to this question. This appendix may include graphics describing the innovation or the nature of the problem. You may want to include evidence of freedom to operate, patent searches or competitor analysis as supporting information.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 5 sides of A4. Longer appendices will only have the first 5 pages assessed</li><li>be less than 1mb in size</li></ul>',0,195,'APPLICATION','','PDF'),(537,NULL,23,7,0,'Question score',NULL,NULL,0,195,'ASSESSMENT','',NULL),(538,100,2,7,0,'Feedback','Guidance for assessing innovation','Your score should be based upon the following:',1,195,'ASSESSMENT','',NULL),(539,400,2,2,1,'7. What are the risks (technical, commercial and environmental) to your project\'s success? What is your risk management strategy?','What should I include in the project risks section?','<p>Please describe your plans for limiting and managing risk. You need to:</p><ul class=\"list-bullet\">         <li>identify the project\'s main risks and uncertainties</li><li>detail specific technical, commercial, managerial and environmental risks</li><li>list any other uncertainties such as ethical issues associated with the project</li><li>provide a detailed risk analysis</li><li>rate the main risks as high, medium or low</li><li>show how you\'ll limit the main risks</li><li>identify the project management resources you\'ll use to minimise operational risk</li><li>include arrangements for managing the project team and its partners</li></ul>',0,196,'APPLICATION','',NULL),(540,NULL,23,2,0,'Question score',NULL,NULL,0,196,'ASSESSMENT','',NULL),(541,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,196,'APPLICATION','\0','PDF'),(542,100,2,2,0,'Feedback','Guidance for assessing risks','Your score should be based upon the following:',1,196,'ASSESSMENT','',NULL),(543,400,2,2,1,'8. Does your project team have the skills, experience and facilities to deliver this project?','What should I include in the project skills section?','<p>You should show your project team:</p><ul class=\"list-bullet\"><li>has the right mix of skills and experience to complete the project</li><li>has clear objectives</li><li>would have been formed even without Innovate UK investment</li></ul><p>If you are part of a consortium, describe the benefits of the collaboration, for example, increased knowledge transfer.</p>',0,197,'APPLICATION','',NULL),(544,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to provide details of the specific expertise and track record of each project partner and each subcontractor. Academic collaborators may refer to their research standing.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>include up to half an A4 page per partner describing the skills and experience of the main people who will be working on the project</li><li>be less than 1mb in size</li></ul>',0,197,'APPLICATION','','PDF'),(545,NULL,23,2,0,'Question score',NULL,NULL,0,197,'ASSESSMENT','',NULL),(546,100,2,2,0,'Feedback','Guidance for assessing team skills','Your score should be based upon the following:',1,197,'ASSESSMENT','',NULL),(547,400,2,2,1,'9. What will your project cost?','What should I include in the project cost section?','<p>You must:</p><ul class=\"list-bullet\"><li>show how your budget is realistic for the scale and complexity of the project</li><li>make sure the funding you need from Innovate UK is within the limit set by this competition</li><li>justify any significant costs in the project, such as subcontractors</li><li>show how much funding there will be from other sources</li><li>provide a realistic budget breakdown</li><li>describe and justify individual work packages</li></ul><p>Find out which <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs are eligible.</a></p><p>If your project spans more than one type of research category, you must break down the costs as separate \'work packages\'. For example, industrial research or experimental development. </p><p>You can find more information in the  <a href=\"https://www.gov.uk/guidance/innovate-uk-funding-general-guidance-for-applicants#funding-rules\">funding rules section</a> of this website.</p>',0,198,'APPLICATION','',NULL),(548,NULL,23,2,0,'Question score',NULL,NULL,0,198,'ASSESSMENT','',NULL),(549,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,198,'APPLICATION','\0','PDF'),(550,100,2,2,0,'Feedback','Guidance for assessing financial commitment','Your score should be based upon the following:',1,198,'ASSESSMENT','',NULL),(551,400,2,2,1,'10. How does financial support from Innovate UK and its funding partners add value?','What should I include in the financial support from Innovate UK section?','Justify why you\'re unable to fund the project yourself from commercial resources. Explain the difference this funding will make to your project. For example, will it lower the risk for you or speed up the process of getting your product to market? Tell us why this will benefit the UK.',0,199,'APPLICATION','',NULL),(552,NULL,23,2,0,'Question score',NULL,NULL,0,199,'ASSESSMENT','',NULL),(553,NULL,4,2,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,199,'APPLICATION','\0','PDF'),(554,100,2,2,0,'Feedback','Guidance for assessing added value','Your score should be based upon the following:',1,199,'ASSESSMENT','',NULL),(555,NULL,15,7,1,NULL,'','',0,200,'APPLICATION','',NULL),(556,NULL,19,7,1,'Size',NULL,NULL,0,201,'APPLICATION','',NULL),(557,NULL,4,7,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,201,'APPLICATION','\0','PDF'),(558,NULL,24,7,0,'Turnover (£)','Your turnover from the last financial year.','',1,201,'APPLICATION','',NULL),(559,NULL,25,7,0,'Full time employees','Number of full time employees at your organisation.','',2,201,'APPLICATION','',NULL),(560,NULL,26,7,0,'End of last financial year','Enter the date of your last financial year.','',3,201,'APPLICATION','\0',NULL),(561,NULL,27,7,0,'Annual turnover','','',4,201,'APPLICATION','\0',NULL),(562,NULL,27,7,0,'Annual profits','','',5,201,'APPLICATION','\0',NULL),(563,NULL,27,7,0,'Annual export','','',6,201,'APPLICATION','\0',NULL),(564,NULL,27,7,0,'Research and development spend','','',7,201,'APPLICATION','\0',NULL),(565,NULL,28,7,0,'Full time employees','How many full-time employees did you have on the project at the close of your last financial year?','',8,201,'APPLICATION','\0',NULL),(566,NULL,17,7,1,'Other funding','What should I include in the other public funding section?','<p>You must provide details of other public funding that you are currently applying for (or have already applied for) in relation to this project. You do not need to include completed grants that were used to reach this point in the development process. This information is important as other public sector support counts as part of the funding you can receive for your project.</p>',0,202,'APPLICATION','',NULL),(567,NULL,7,7,1,'Please enter the grant % you wish to claim for this project','What funding level should I enter?','<p>For a business or academic organisation, you can apply for any funding percentage between 0% and the maximum allowable for your organisation size. For other organisation types, you can apply for any funding percentage between 0% and 100%. The amount you apply for must reflect other funding you may have received. It must also be within participation levels which you can review on the Finances Overview page.</p>',0,203,'APPLICATION','',NULL),(568,NULL,20,7,1,'Upload a pdf copy of the Je-S output form once you have a status of \'With Council\'.',NULL,NULL,0,204,'APPLICATION','',NULL),(569,NULL,6,7,1,NULL,'Labour costs guidance','<p>You can include the following labour costs, based upon your PAYE records:</p><ul class=\"list-bullet\"><li>gross salary</li><li>National Insurance</li><li>company pension contribution</li><li>life insurance</li><li>other non-discretionary package costs.</li></ul><p>You can\'t include:</p><ul class=\"list-bullet\"><li>discretionary bonuses</li><li>performance related payments of any kind</li></ul><p>You may include the total number of working days for staff but do not include:</p><ul class=\"list-bullet\"><li>sick days</li><li>waiting time</li><li>training days</li><li>non-productive time</li></ul><p>Enter the total number of working days in the year. List the total days worked by all categories of staff on your project. Describe their role.</p><p>We will review the total amount of time and cost of labour before we approve your application. The terms and conditions of the grant include compliance with these points.</p>',0,205,'APPLICATION','',NULL),(570,NULL,8,7,1,'Labour',NULL,NULL,0,206,'APPLICATION','',NULL),(571,NULL,6,7,1,NULL,NULL,NULL,0,207,'APPLICATION','',NULL),(572,NULL,9,7,1,'Overheads',NULL,NULL,0,208,'APPLICATION','',NULL),(573,NULL,6,7,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,209,'APPLICATION','',NULL),(574,NULL,10,7,1,'Materials',NULL,NULL,0,210,'APPLICATION','',NULL),(575,NULL,6,7,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its Net Present Value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,211,'APPLICATION','',NULL),(576,NULL,11,7,1,'Capital Usage',NULL,NULL,0,212,'APPLICATION','',NULL),(577,NULL,6,7,1,NULL,'Subcontracting costs guidance','<p>Subcontracting costs relate to work carried out by third party organisations. These organisations are not part of your project or collaboration.</p><p>Subcontracting is eligible providing it’s justified as to why the work cannot be performed by a project partner.</p><p>Where possible you should select a UK based contractor. You should name the subcontractor (where known) and describe what they will be doing. You should also state where the work will be undertaken. We will look at the size of this contribution when assessing your eligibility and level of support.</p>',0,213,'APPLICATION','',NULL),(578,NULL,12,7,1,'Sub-contracting costs',NULL,NULL,0,214,'APPLICATION','',NULL),(579,NULL,6,7,1,NULL,NULL,NULL,0,215,'APPLICATION','',NULL),(580,NULL,13,7,1,'Travel and subsistence',NULL,NULL,0,216,'APPLICATION','',NULL),(581,NULL,6,7,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for New IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,217,'APPLICATION','',NULL),(582,NULL,14,7,1,'Other costs',NULL,NULL,0,218,'APPLICATION','',NULL),(583,NULL,16,7,1,NULL,NULL,NULL,0,219,'APPLICATION','',NULL),(584,NULL,6,7,1,NULL,NULL,NULL,0,220,'APPLICATION','',NULL),(585,NULL,20,6,1,'Upload a pdf copy of the Je-S output form once you have a status of \'With Council\'.',NULL,NULL,0,221,'APPLICATION','',NULL),(586,NULL,5,8,1,'Application details',NULL,NULL,0,222,'APPLICATION','',NULL),(592,400,2,8,1,'1. What is the business opportunity and potential market for your project?','What should I include in the business opportunity and potential market section?','<p>Describe:</p><ul class=\"list-bullet\"><li>the main motivation for your project: the business need or market opportunity</li><li>the domestic and international markets you will target, and the other markets you are considering targeting</li></ul>',0,225,'APPLICATION','',NULL),(593,NULL,23,8,0,'Question score',NULL,NULL,0,225,'ASSESSMENT','',NULL),(594,NULL,4,8,1,'Appendix','What should I include in the appendix?','<p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,225,'APPLICATION','\0',NULL),(595,100,2,8,0,'Feedback','Guidance for assessing market opportunity','Your score should be based upon the following:',0,225,'ASSESSMENT','',NULL),(596,400,2,8,1,'2. What is innovative about your project?','What should I include in the project innovation section?','<p>Describe:</p><ul class=\"list-bullet\">         <li>what the innovation will focus on</li><li>whether your project will apply existing technologies to new areas, develop new technologies for existing areas or use a totally disruptive approach</li><li>the freedom you have to operate</li></ul></ul>',0,226,'APPLICATION','',NULL),(597,NULL,23,8,0,'Question score',NULL,NULL,0,226,'ASSESSMENT','',NULL),(598,NULL,4,8,1,'Appendix','What should I include in the appendix?','<p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,226,'APPLICATION','\0',NULL),(599,100,2,8,0,'Feedback','Guidance for assessing innovation','Your score should be based upon the following:',0,226,'ASSESSMENT','',NULL),(600,400,2,8,1,'3. Who is in the project team and what are their roles?','What should I include in the project team section?','<p>Describe or give:</p><ul class=\"list-bullet\">         <li>the roles, skills and relevant experience of all members of the project team</li><li>the resources, equipment and facilities required for your project, and how you will access them</li><li>details of any external parties, including sub-contractors, you will need</li></ul>',0,227,'APPLICATION','',NULL),(601,NULL,23,8,0,'Question score',NULL,NULL,0,227,'ASSESSMENT','',NULL),(602,NULL,4,8,1,'Appendix','What should I include in the appendix?','<p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,227,'APPLICATION','\0',NULL),(603,100,2,8,0,'Feedback','Guidance for assessing team skills','Your score should be based upon the following:',0,227,'ASSESSMENT','',NULL),(604,400,2,8,1,'4. How much will your project cost, and how does it represent value for money for your team and the taxpayer?','What should I include in the funding and adding value section?','<p>Tell us:</p><ul class=\"list-bullet\"><li>what you estimate your project will cost in total</li><li>how your project’s goals justify the total project cost and the grant you are requesting</li><li>how your project represents value for money for you, and for the taxpayer</li><li>what you would spend your money on otherwise</li><li>whether your project could go ahead in any form without public funding, and if so, what difference the funding would make, such as speeding up the route to market, attracting more partners or reducing risk</li></ul>',0,228,'APPLICATION','',NULL),(605,NULL,23,8,0,'Question score',NULL,NULL,0,228,'ASSESSMENT','',NULL),(606,NULL,4,8,1,'Appendix','What should I include in the appendix?','<p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,228,'APPLICATION','\0',NULL),(607,100,2,8,0,'Feedback','Guidance for assessing funding and adding value','Your score should be based upon the following:',0,228,'ASSESSMENT','',NULL),(608,NULL,5,27,1,'Application details',NULL,NULL,0,233,'APPLICATION','',NULL),(609,NULL,5,13,1,'Application details',NULL,NULL,0,235,'APPLICATION','',NULL),(610,NULL,5,21,1,'Application details',NULL,NULL,0,237,'APPLICATION','',NULL),(611,NULL,5,18,1,'Application details',NULL,NULL,0,239,'APPLICATION','',NULL),(612,NULL,5,9,1,'Application details',NULL,NULL,0,238,'APPLICATION','',NULL),(613,NULL,5,22,1,'Applicatio