li></ul>',0,371,'APPLICATION','','PDF'),(978,100,2,10,0,'Feedback','Guidance for assessing project exploitation','Your score should be based upon the following:',1,360,'ASSESSMENT','',NULL),(979,NULL,6,16,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,372,'APPLICATION','',NULL),(980,400,2,19,1,'2. What is the size of the potential market for your project?','What should I include in the market opportunity section?','<p>Describe the size of the potential market for your project, including:</p><ul class=\"list-bullet\">         <li>details of your target market, for instance, how competitive and profitable it is</li><li>the current size of the market, with actual and predicted growth rates</li><li>the market share you expect to achieve and the reasons for this estimate</li><li>the wider economic value you expect your project to add to the UK and/or the EEA (European Economic Area)</li></ul><p>Tell us what return on investment you expect your project to achieve. You should base this estimate on relevant industry data and tell us how you have calculated this.</p><p>If you are targeting an undeveloped market, you should also:</p><ul class=\"list-bullet\">         <li>describe how you plan to access this market</li><li>estimate its potential size</li><li>explain how you will explore its potential</li></ul>',0,370,'APPLICATION','',NULL),(981,NULL,23,15,0,'Question score',NULL,NULL,0,362,'ASSESSMENT','',NULL),(982,100,2,14,0,'Feedback','Guidance for assessing economic benefits','Your score should be based upon the following:',1,365,'ASSESSM