ience and technology</li><li>apply existing technologies in new areas</li></ul><p>Explain the novelty of the research in an industrial and/or academic context.</p><p>You should provide evidence that your proposed work is innovative. This could include patent search results, competitor analyses or literature surveys. If relevant, you should also outline your own intellectual property rights.</p>',0,381,'APPLICATION','',NULL),(1005,400,2,22,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the technical approach section?','<p>You should:</p><ul class=\"list-bullet\">         <li>describe your technical approach including the main objectives of the work</li><li>explain how and why your approach is appropriate</li><li>tell us how you will make sure that the innovative steps in your project are achievable</li><li>describe rival technologies and alternative R&D strategies</li><li>explain why your proposed approach will offer a better outcome</li></ul>',0,376,'APPLICATION','',NULL),(1006,400,2,25,1,'4. What economic, social and environmental benefits do you expect your project to deliver and when?','What should I include in the benefits section?','<p>Describe all the benefits you expect your project to deliver, including:</p><p><strong>Economic</strong> : this is the real impact the project will have on its economic environment. This is not traditional corporate accounting profit and can include cost avoidance. You should identify and quantify any expected benefits to:</p><ul class=\"list-bullet\"><li>users (intermediaries and end users)</li><li>suppliers</li><li>broader industrial markets</li><li>the UK economy</li></ul><p><strong>Social</strong> : quantify any expected social impacts either positive or negative on, for example:</p><ul class=\"list-bullet\"><li>quality of life</li><li>social inclusion/exclusion</li><li>education</li><li>public empowerment</li><li>health and safety</li><li>regulation</li><li>diversity</li><li>government priorities</li></ul><p><strong>Environmental</strong> : show how your project will benefit or have a low impact on the environment. For example, this could include:<p><ul class=\"list-bullet\"><li>careful management of energy consumption</li><li>reductions in carbon emissions</li><li>reducing manufacturing and materials waste</li><li>rendering waste less toxic before disposing of it in a safe and legal manner</li><li>re-manufacturing (cradle to cradle)</li></ul>',0,377,'APPLICATION','',NULL),(1007,400,2,15,1,'','What should I include in the market awareness section? ','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">the markets (domestic and/or international) you will be targeting in the project and any other potential markets</li><li class=\"li2\">for the target markets, describe:</li><ul><li class=\"li2\">the size of the target markets for the project outcomes, backed up by references where available</li><li class=\"li2\">the structure and dynamics of the market (such as customer segmentation), together with predicted growth rates within clear timeframes</li><li class=\"li2\">the main supply/value chains and business models in operation (and any barriers to entry)</li><li class=\"li2\">the current UK position in targeting this market</li></ul><li class=\"li2\">for highly innovative projects, where the market may be unexplored, explain:</li><ul><li class=\"li2\">what the route to market could or might be</li><li class=\"li2\">what its size might be</li><li class=\"li2\">how the project will look to explore the market potential</li></ul><li class=\"li2\">briefly describe the size and main features of any other markets not already listed</li></ul>',0,380,'APPLICATION','',NULL),(1008,NULL,4,17,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support your response to this question. This appendix may include graphics describing the innovation or the natur