ch the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,392,'APPLICATION','\0','PDF'),(1061,NULL,12,16,1,'Sub-contracting costs',NULL,NULL,0,394,'APPLICATION','',NULL),(1062,100,2,18,0,'Feedback','Guidance for assessing risks','Your score should be based upon the following:',1,391,'ASSESSMENT','',NULL),(1063,400,2,27,1,'6. What is innovative about your project?','What should I include in the project innovation section?','<p>You should show how your project will:</p><ul class=\"list-bullet\">         <li>push boundaries beyond current leading-edge science and technology</li><li>apply existing technologies in new areas</li></ul><p>Explain the novelty of the research in an industrial and/or academic context.</p><p>You should provide evidence that your proposed work is innovative. This could include patent search results, competitor analyses or literature surveys. If relevant, you should also outline your own intellectual property rights.</p>',0,397,'APPLICATION','',NULL),(1064,100,2,9,0,'Feedback','Guidance for assessing innovation','Your score should be based upon the following:',1,389,'ASSESSMENT','',NULL),(1065,400,2,15,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the outcomes and route to market section?','<p class=\"p1\">You should describe or explain:</p><ul><li class=\"li2\">your current position in the markets and supply/value chains outlined (will you be extending or establishing your market position?)</li><li class=\"li2\">your target customers and/or end users, and the value to them (why would they use/buy it?)</li><li class=\"li2\">your route to market</li><li class=\"li2\">how you are going to profit from the innovation (increased revenues or cost reduction)</li><li class=\"li2\">how the innovation will impact your productivity and growth (in the short and long-term)</li><li class=\"li2\">how you will protect and exploit the outputs of the project, for example through know-how, patenting, designs, changes to business model</li><li class=\"li2\">your strategy for targeting the other markets identified during or after the project</li><li class=\"li2\">for any research organisation activity in the project, describe your plans to spread project research outputs over a reasonable timescale</li><li class=\"li2\">if you expect to use the results generated from the project in further research activities, describe how</li></ul>',0,395,'APPLICATION','',NULL),(1066,NULL,23,12,0,'Question score',NULL,NULL,0,378,'ASSESSMENT','',NULL),(1067,100,2,10,0,'Feedback','Guidance for assessing economic benefits','Your score should be based upon the following:',1,392,'ASSESSMENT','',NULL),(1068,400,2,25,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the technical approach section?','<p>You should:</p><ul class=\"list-bullet\">         <li>describe your technical approach including the main objectives of the work</li><li>explain how and why your approach is appropriate</li><li>tell us how you will make sure that the innovative steps in your project are achievable</li><li>describe rival technologies and alternative R&D strategies</li><li>explain why your proposed approach will offer a better outcome</li></ul>',0,398,'APPLICATION','',NULL),(1069,400,2,20,1,'4. What economic, social and environmental benefits do you expect your project to deliver and when?','What should I include in the benefits section?','<p>Describe all the benefits you expect your project to deliver, including:</p><p><strong>Economic</strong> : this is the real impact the project will have on its economic environment. This is not traditional corporate accounting profit and can include cost avoidance. You should identify and quantify any expected benefits to:</p><ul class=\"list-bullet\"><li>users (intermediaries and end users)</li><li>suppliers</li><li>broader industrial markets</li><li>the UK economy</li></ul><p><strong>Social</strong> : quantify any expected social impacts either positive or negative on, for example:</p><ul class=\"list-bullet\"><li>quality of life</li><li>social inclusion/exclusion</li><li>education</li><li>public empowerment</li><li>health and safety</li><li>regulation</li><li>diversity</li><li>government priorities</li></ul><p><strong>Environmental</strong> : show how your project will benefit or have a low impact on the environment. For example, this could include:<p><ul class=\"list-bullet\"><li>careful management of energy consumption</li><li>reductions in carbon emissions</li><li>reducing manufacturing and materials waste</li><li>rendering waste less toxic before disposing of it in a safe and legal manner</li><li>re-manufacturing (cradle to cradle)</li></ul>',0,393,'APPLICATION','',NULL),(1070,400,2,22,1,'6. What is innovative about your project?','What should I include in the project innovation section?','<p>You should show how your project will:</p><ul class=\"list-bullet\">         <li>push boundaries beyond current leading-edge science and technology</li><li>apply existing technologies in new areas</li></ul><p>Explain the novelty of the research in an industrial and/or academic context.</p><p>You should provide evidence that your proposed work is innovative. This could include patent search results, competitor analyses or literature surveys. If relevant, you should also outline your own intellectual property rights.</p>',0,402,'APPLICATION','',NULL),(1071,NULL,4,13,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support your response to this question. This appendix may include graphics describing the innovation or the nature of the problem. You may want to include evidence of freedom to operate, patent searches or competitor analysis as supporting information.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 5 sides of A4. Longer appendices will only have the first 5 pages assessed</li><li>be less than 1mb in size</li></ul>',0,385,'APPLICATION','','PDF'),(1072,NULL,4,25,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',0,398,'APPLICATION','','PDF'),(1073,400,2,18,1,'8. Does your project team have the skills, experience and facilities to deliver this project?','What should I include in the project skills section?','<p>You should show your project team:</p><ul class=\"list-bullet\"><li>has the right mix of skills and experience to complete the project</li><li>has clear objectives</li><li>would have been formed even without Innovate UK investment</li></ul><p>If you are part of a consortium, describe the benefits of the collaboration, for example, increased knowledge transfer.</p>',0,404,'APPLICATION','',NULL),(1074,NULL,6,16,1,NULL,NULL,NULL,0,403,'APPLICATION','',NULL),(1075,NULL,4,27,1,'Appendix','Wha