d project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,407,'APPLICATION','\0','PDF'),(1103,100,2,22,0,'Feedback','Guidance for assessing innovation','Your score should be based upon the following:',1,402,'ASSESSMENT','',NULL),(1104,NULL,6,16,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for New IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,408,'APPLICATION','',NULL),(1105,400,2,18,1,'9. What will your project cost?','What should I include in the project cost section?','<p>You must:</p><ul class=\"list-bullet\"><li>show how your budget is realistic for the scale and complexity of the project</li><li>make sure the funding you need from Innovate UK is within the limit set by this competition</li><li>justify any significant costs in the project, such as subcontractors</li><li>show how much funding there will be from other sources</li><li>provide a realistic budget breakdown</li><li>describe and justify individual work packages</li></ul><p>Find out which <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs are eligible.</a></p><p>If your project spans more than one type of research category, you must break down the costs as separate \'work packages\'. For example, industrial research or experimental development. </p><p>You can find more information in the  <a href=\"https://www.gov.uk/guidance/innovate-uk-funding-general-guidance-for-applicants#funding-rules\">funding rules section</a> of this website.</p>',0,410,'APPLICATION','',NULL),(1106,100,2,19,0,'Feedback','Guidance for assessing economic benefits','Your score should be based upon the following:',1,399,'ASSESSMENT','',NULL),(1107,100,2,11,0,'Feedback','Guidance for assessing economic benefits','Your score should be based upon the following:',1,400,'ASSESSMENT','',NULL),(1108,400,2,20,1,'5. What technical approach will you use and how will you manage your project?','What should I include in the technical approach section?','<p>You should:</p><ul class=\"list-bullet\">         <li>describe your technical approach including the main objectives of the work</li><li>explain how and why your approach is appropriate</li><li>tell us how you will make sure that the innovative steps in your project are achievable</li><li>describe rival technologies and alternative R&D strategies</li><li>explain why your proposed approach will offer a better outcome</li></ul>',0,411,'APPLICATION','',NULL),(1109,100,2,15,0,'Feedback','Guidance for assessing outcomes and route to market','Your score should be based upon the following:',1,395,'ASSESSMENT','',NULL),(1110,100,2,9,0,'Feedback','Guidance f