edge transfer.</p>',0,456,'APPLICATION','',NULL),(1288,NULL,23,20,0,'Question score',NULL,NULL,0,454,'ASSESSMENT','',NULL),(1289,400,2,23,1,'9. What will your project cost?','What should I include in the project cost section?','<p>You must:</p><ul class=\"list-bullet\"><li>show how your budget is realistic for the scale and complexity of the project</li><li>make sure the funding you need from Innovate UK is within the limit set by this competition</li><li>justify any significant costs in the project, such as subcontractors</li><li>show how much funding there will be from other sources</li><li>provide a realistic budget breakdown</li><li>describe and justify individual work packages</li></ul><p>Find out which <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs are eligible.</a></p><p>If your project spans more than one type of research category, you must break down the costs as separate \'work packages\'. For example, industrial research or experimental development. </p><p>You can find more information in the  <a href=\"https://www.gov.uk/guidance/innovate-uk-funding-general-guidance-for-applicants#funding-rules\">funding rules section</a> of this website.</p>',0,457,'APPLICATION','',NULL),(1290,NULL,17,16,1,'Other funding','What should I include in the other public funding section?','<p>You must provide details of other public funding that you are currently applying for (or have already applied for) in relation to this project. You do not need to include completed grants that were used to reach this point in the development process. This information is important as other public sector support counts as part of the funding you can receive for your project.</p>',0,455,'APPLICATION','',NULL),(1291,100,2,15,0,'Feedback','Guidance for assessing risks','Your score should be based upon the following:',1,453,'ASSESSMENT','',NULL),(1292,NULL,23,27,0,'Question score',NULL,NULL,0,443,'ASSESSME