their research standing.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>include up to half an A4 page per partner describing the skills and experience of the main people who will be working on the project</li><li>be less than 1mb in size</li></ul>',0,460,'APPLICATION','','PDF'),(1304,NULL,6,18,1,NULL,'Labour costs guidance','<p>You can include the following labour costs, based upon your PAYE records:</p><ul class=\"list-bullet\"><li>gross salary</li><li>National Insurance</li><li>company pension contribution</li><li>life insurance</li><li>other non-discretionary package costs.</li></ul><p>You can\'t include:</p><ul class=\"list-bullet\"><li>discretionary bonuses</li><li>performance related payments of any kind</li></ul><p>You may include the total number of working days for staff but do not include:</p><ul class=\"list-bullet\"><li>sick days</li><li>waiting time</li><li>training days</li><li>non-productive time</li></ul><p>Enter the total number of working days in the year. List the total days worked by all categories of staff on your project. Describe their role.</p><p>We will review the total amount of time and cost of labour before we approve your application. The terms and conditions of the grant include compliance with these points.</p>',0,458,'APPLICATION','',NULL),(1305,NULL,23,26,0,'Question score',NULL,NULL,0,450,'ASSESSMENT','',NULL),(1306,NULL,23,21,0,'Question score',NULL,NULL,0,460,'ASSESSMENT','',NULL),(1307,400,2,9,1,'10. How does financial support from Innovate UK and its funding partners add value?','What should I include in the financial support from Innovate UK section?','Justify why you\'re unable to fund the project yourself from commercial resources. Explain the difference this funding will make to your project. For example, will it lower the risk for you or speed up the process of getting your product to market? Tell us why this will benefit the UK.',0,462,'APPLICATION','',NULL),(1308,NULL,23,17,0,'Question score',NULL,NULL,0,459,'ASSESSMENT','',NULL),(1309,100,2,26,0,'Feedback','Guidance for assessing team skills','Your score should be based upon the following:',1,450,'ASSESSMENT','',NULL),(1310,NULL,23,10,0,'Question score',NULL,NULL,0,461,'ASSESSMENT','',NULL),(1311,NULL,15,22,1,NULL,'','',0,468,'APPLICATION','',NULL),(1312,100,2,21,0,'Feedback','Guidance for assessing team skills','Your score should be based upon the following:',1,460,'ASSESSMENT','',NULL),(1313,NULL,4,17,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,459,'APPLICATION','\0','PDF'),(1314,400,2,14,1,'9. What will your project cost?','What should I include in the project cost section?','<p>You must:</p><ul class=\"list-bullet\"><li>show how your budget is realistic for the scale and complexity of the project</li><li>make sure the funding you need from Innovate UK is within the limit set by this competition</li><li>justify any significant costs in the project, such as subcontractors</li><li>show how much funding there will be from other sources</li><li>provide a realistic budget breakdown</li><li>describe and justify individual work packages</li></ul><p>Find out which <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project c