d. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,582,'APPLICATION','',NULL),(1533,NULL,6,9,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,577,'APPLICATION','',NULL),(1534,NULL,8,21,1,'Labour',NULL,NULL,0,586,'APPLICATION','',NULL),(1535,NULL,6,11,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,584,'APPLICATION','',NULL),(1536,NULL,6,26,1,NULL,'Overheads costs guidance','<p>If you wish to claim overheads, there are 2 options available to you:</p><p>Option 1: 20% overhead option. This allows you to claim 20% of your labour costs as overhead. No further documentation is needed.</p><p>Option2: Calculate overheads. This allows you to calculate direct and indirect overheads using our overhead spreadsheet. The overhead value claimed under this method will be subject to review if your application is successful. This is in order to assess the appropriateness of the overhead value you are claiming.</p>',0,585,'APPLICATION','',NULL),(1537,NULL,4,20,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,566,'APPLICATION','\0','PDF'),(1538,NULL,15,10,1,NULL,'','',0,583,'APPLICATION','',NULL),(1539,NULL,6,18,1,NULL,'Subcontracting costs guidance','<p>Subcontracting costs relate to work carried out by third party organisations. These organisations are not part of your project.</p><p>Subcontracting is eligible providing it’s justified as to why the work cannot be performed by a project partner.</p><p>Subcontracting associate companies should be charged at cost.</p><p>Where possible you should select a UK based contractor. You should name the subcontractor (where known) and describe what they will be doing. You should also state where the work will be undertaken. We will look at the size of this contribution when assessing your eligibility and level of support.</p>',0,590,'APPLICATION','',NULL),(1540,NULL,8,25,1,'Labour',NULL,NULL,0,593,'APPLICATION','',NULL),(1541,NULL,11,9,1,'Capital Usage',NULL,NULL,0,592,'APPLICATION','',NULL),(1542,NULL,6,27,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,587,'APPLICATION','',NULL),(1543,NULL,4,19,1,'Appendix','What should I include in the appendix?','<p>You may include an appendix of additional information to support the technical approach the project will undertake.</p><p>You may include, for example, a Gantt chart or project management structure.</p><p>The appendix should:</p><ul class=\"list-bullet\"><li>be in a portable document format (.pdf)</li><li>be readable with 100% magnification</li><li>contain your application number and project title at the top</li><li>not be any longer than 6 sides of A4. Longer appendices will only have the first 6 pages assessed</li><li>be less than 1mb in size</li></ul>',1,568,'APPLICATION','\0','PDF'),(1544,NULL,6,22,1,NULL,'Other costs guidance','<p>Examples of other costs include:</p><p><strong>Training costs:</strong> these costs are eligible for support if they relate to your project. We may support management training for your project but will not support ongoing training.</p><p><strong>Workshop/laboratory usage charges:</strong> direct costs which relate to workshops or laboratories and which can be supported with actual usage data can be claimed. You should provide details of how the workshop/laboratory charge out rates per hour or day are calculated. This can include specific labour, rent, rates, maintenance, equipment, calibration costs, etc. These should form the overall costs together with the available operational hours to form the hourly or daily charge out rates.</p><p><strong>Preparation of technical reports:</strong> if, for example, the main aim of your project is standard support or technology transfer. You should show how this is more than you would produce through good project management.</p><p><strong>Market assessment:</strong> we may support market assessments studies. The study will need to help us understand how your project is a good match for your target market. It could also be eligible if it helps commercialise your product.</p><p><strong>Licensing in new technologies:</strong> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for new IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,588,'APPLICATION','',NULL),(1545,NULL,6,13,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,589,'APPLICATION','',NULL),(1546,100,2,20,0,'Feedback','Guidance for assessing added value','Your score should be based upon the following:',1,566,'ASSESSMENT','',NULL),(1547,NULL,6,12,1,NULL,'Materials costs guidance','<p>Materials supplied by associated companies or project partners should be charged at cost.</p><p>Software that you have purchased specifically for use during your project may be included. If you already own the software then only additional costs which are incurred and paid during your project, will be eligible. For example, installation, training or customisation.</p><p>Material costs must be itemised to justify that they are eligible.</p>',0,594,'APPLICATION','',NULL),(1548,NULL,9,26,1,'Overheads',NULL,NULL,0,595,'APPLICATION','',NULL),(1549,NULL,10,11,1,'Materials',NULL,NULL,0,596,'APPLICATION','',NULL),(1550,NULL,12,18,1,'S