g> if new technology makes up a large part of your project, we will expect you to develop that technology. For instance, if the value of the technology is more than &pound;100,000.</p><p><strong>Patent filing costs for new IP generated by your project:</strong> these are eligible for SMEs up to a limit of &pound;7,500 per partner. You should not include legal costs relating to the filing or trademark related expenditure.</p><p>Regulatory compliance costs are eligible if necessary to carry out your project.</p>',0,732,'APPLICATION','',NULL),(1748,NULL,13,21,1,'Travel and subsistence',NULL,NULL,0,743,'APPLICATION','',NULL),(1749,NULL,6,10,1,NULL,'Capital usage guidance','<p>You will need to calculate a ‘usage’ value for each item. You can do this by deducting its expected value from its original price at the end of your project. If you owned the equipment before the project started then you should use its net present value.</p><p>This value is then multiplied by the amount, in percentages, that is used during the project. This final value represents the eligible cost to your project.</p>',0,752,'APPLICATION','',NULL),(1750,NULL,27,12,0,'Annual profits','','',5,731,'APPLICATION','\0',NULL),(1751,NULL,24,17,0,'Turnover (£)','Your turnover from the last financial year.','',1,740,'APPLICATION','',NULL),(1752,NULL,17,11,1,'Other funding','What should I include in other funding?','<p>You do not need to include completed grants that were used to reach this point in the development process.</p>',0,755,'APPLICATION','',NULL),(1753,NULL,17,9,1,'Other funding','What should I include in other funding?','<p>You do not need to include completed grants that were used to reach this point in the development process.</p>',0,754,'APPLICATION','',NULL),(1754,NULL,27,12,0,'Annual export','','',6,731,'APPLICATION','\0',NULL),(1755,NULL,24,27,0,'Turnover (£)','Your turnover from the last financial year.','',1,727,'APPLICATION','',NULL),(1756,NULL,14,13,1,'Other costs',NULL,NULL,0,748