navailable in the UK will be required.  Our Fabrication partner has already investigated options for accessing this equipment in the Far East and an appropriate budget has been set aside to be used for this purpose if required.\n\n',1286,92,74,NULL),(2075,NULL,NULL,NULL,NULL,NULL,NULL),(2076,'2018-02-08 16:45:39','This is the applicant response for what technical approach will you use and how will you manage your project?.',1108,185,109,NULL),(2077,NULL,NULL,NULL,NULL,NULL,NULL),(2078,'2018-02-08 16:45:39','This is the applicant response for does your project team have the skills, experience and facilities to deliver this project?.',1386,183,107,NULL),(2079,NULL,NULL,NULL,NULL,NULL,NULL),(2080,'2018-02-08 16:45:39','This is the applicant response for does your project team have the skills, experience and facilities to deliver this project?.',1386,180,104,NULL),(2081,'2018-02-08 16:45:39','This is the applicant response for public description.',655,200,119,NULL),(2082,NULL,NULL,NULL,NULL,NULL,NULL),(2083,'2018-02-08 16:45:39','This is the applicant response for what is innovative about your project?.',1191,199,120,NULL),(2084,NULL,NULL,NULL,NULL,NULL,NULL),(2085,'2018-02-08 16:45:39','This is the applicant response for what is the size of the potential market for your project?.',877,205,125,NULL),(2086,NULL,NULL,NULL,NULL,NULL,NULL),(2087,'2018-02-08 16:45:39',NULL,1115,185,109,195),(2088,NULL,NULL,NULL,NULL,NULL,NULL),(2089,'2018-02-08 16:45:39','This is the applicant response for what is the business opportunity that your project addresses?.',775,190,112,NULL),(2090,'2018-02-08 16:45:39','This is the applicant response for what economic, social and environmental benefits do you expect your project to deliver and when?.',1069,204,124,NULL),(2091,NULL,NULL,NULL,NULL,NULL,NULL),(2092,'2018-02-08 16:45:39','This is the applicant response for project summary.',634,194,116,NULL),(2093,NULL,NULL,NULL,NULL,NULL,NULL),(2094,'2018-02-08 16:45:39',NULL,1388,183,107,196),(2095