t will help to build a portfolio of IP to enhance commercial exploitation. NB. RAMP does not simply reduce stresses by working at higher temperatures; it involves a novel step based on manufacturing engineering and material science that completely eliminates stresses.',1170,69,48,NULL),(2887,'2018-02-08 16:45:51','This is the applicant response for does your project team have the skills, experience and facilities to deliver this project?.',1386,222,136,NULL),(2888,'2018-02-08 16:45:51','This is the applicant response for how does financial support from innovate uk and its funding partners add value?.',1517,219,135,NULL),(2889,NULL,NULL,NULL,NULL,NULL,NULL),(2890,NULL,NULL,NULL,NULL,NULL,NULL),(2891,'2018-02-08 16:45:52','This is the applicant response for project summary.',634,226,138,NULL),(2892,'2018-02-08 16:45:52','The planned end result of the project would be a fully implementable tool that could be rolled out to the industry.\n\n\n\n Once a fully tested prototype can be demonstrated we can start to take orders and travel to international Industry leaders the exhibit the value of the tool.\n\n',970,81,62,NULL),(2893,NULL,NULL,NULL,NULL,NULL,NULL),(2894,'2018-02-08 16:45:52','Three principal risks exist at this stage:\n\n1.        The academic scale up fails to replicate the smaller results either entirely or not to a satisfactory level. In this event the academic partner would begin a controlled scale back to identify if the method needs to be altered during scale up to replicate results.  In the event that the issue can only be identified in the small scale we would build that into our planning for the isolation phase\n\n2.      During the phase to engineer a technique to isolate the issue we anticipate that there are inherent safety issues.  We have consulted an independent firm to ensure that suitable equipment and measures have been put in place to minimise the risk to staff.\n\n3.    Although we are confident that our fabrication partner is the best optio