INSERT INTO `guidance_row` VALUES (1,197,'No','One or more of the above requirements have not been satisfied.',1),(2,197,'Yes','The application contains the following:\nIs the consortia business led?\nAre there two or more partners to the collaboration?\nDoes it meet the scope of the competition as defined in the competition brief?',0),(3,201,'1,2','There is little or no business drive to the project. The results are not relevant to the target customers or no customer interests are provided.',4),(4,201,'3,4','The business opportunity is unrealistic or poorly defined. The customer\'s true needs are not well understood and are not linked to the project\'s objectives.',3),(5,201,'5,6','The business opportunity is plausible but not clearly expressed in terms of customer needs.',2),(6,201,'7,8','The applicants have a good idea of the potential market and opportunities. The needs of the customer are central to the project\'s objectives.',1),(7,201,'9,10','The applicants have a very clear understanding of the business opportunity and the problems that must be overcome to enable successful exploitation. The project is well aligned with these needs.',0),(8,205,'1,2','The market is not well defined or is wrong. No sensible return on investment is provided.',4),(9,205,'3,4','The market size is not quantified but there is some understanding. Return on investment is ill defined or unrealistic.',3),(10,205,'5,6','The market size and dynamics are understood but poorly quantified or stated at a level not really relevant for the project. Return on investment is plausible or badly defined.',2),(11,205,'7,8','The market size and dynamics are described with some quantification relevant to the project. Market understanding is acceptable and the return on investment is achievable.',1),(12,205,'9,10','The market size and dynamics are quantified clearly and to sufficient resolution to be relevant to the project. The market is clearly well understood. The return on investment is clearly stated, quantified and realistic.',0),(13,209,'1,2','The exploitation method is missing or un-feasible and unlikely to succeed.',4),(14,209,'3,4','The exploitation and dissemination methods described are unrealistic or ill-defined.',3),(15,209,'5,6','An exploitation method is defined but lacking in detail or is only just feasible. Dissemination is mentioned.',2),(16,209,'7,8','The main exploitable output of the project is identified and a realistic method defined. Some dissemination is also explained.',1),(17,209,'9,10','The principle exploitable outputs of the project are identified together with clear and achievable exploitation methods. Dissemination opportunities are also identified and appropriate.',0),(18,213,'1,2','The project is damaging to other stakeholders with no realistic mitigation or balance described.',4),(19,213,'3,4','The project has no outside benefits or is potentially damaging to other stakeholders. No mitigation or exploitation is suggested.',3),(20,213,'5,6','Some positive outside benefits are described but the methods to exploit these are not obvious. Or the project is likely to have a negative impact but some mitigation or a balance against the internal benefits is proposed.',2),(21,213,'7,8','Some positive outside benefits are defined and are realistic. Methods of addressing these opportunities are described.',1),(22,213,'9,10','Inside and outside benefits are well defined, realistic and of significantly positive economic, environmental or social impact. Routes to exploit these benefits are also provided.',0),(23,217,'1,2','The plan is totally unrealistic or fails to meet the objectives of the project.',4),(24,217,'3,4','The plan has serious deficiencies or major missing aspects. The plan has little chance of meeting the objectives of the project.',3),(25,217,'5,6','The plan is not completely described or there may be deficiencies in some aspects. More work will be required before the plan can be said to be realistic.',2),(26,217,'7,8','The plan is well described and complete. There is a reasonable chance that it will meet the objectives of the project.',1),(27,217,'9,10','The project plan is fully described and complete with milestones and timeframes. The plan is realistic and should meet the objectives of the project.',0),(28,221,'1,2','The project is either not innovative or there is no exploitable route due to previous IP.',4),(29,221,'3,4','The project lacks sufficient innovation both technically and commercially.',3),(30,221,'5,6','The project is innovative but there is a lack of presented evidence as to the freedom to operate.',2),(31,221,'7,8','The project will be innovative and relevant to the market. There is high confidence that there is freedom to operate.',1),(32,221,'9,10','The project is significantly innovative either commercially or technically and will make a substantial contribution to the field. Solid evidence is presented to substantiate the level of innovation.',0),(33,225,'1,2','The risk analysis is superficial with minimal mitigation or management suggested.',4),(34,225,'3,4','The risk analysis is poor or misses major areas of risk. The mitigation and management is poor.',3),(35,225,'5,6','Most major risks have been identified but there are some gaps or the mitigation and management is insufficient to properly control the risks.',2),(36,225,'7,8','A good risk analysis has been carried out and the management methods and mitigation strategies proposed are realistic.',1),(37,225,'9,10','A thorough risk analysis has been presented across all 3 risk categories. The mitigation and risk management strategies proposed are also appropriate and professional.',0),(38,229,'1,2','The consortium is not capable of either carrying out the project or exploiting the results.',4),(39,229,'3,4','There are significant gaps in the consortium or the formation objectives are unclear. There could be some passengers or the balance of work/commitment is poor.',3),(40,229,'5,6','The consortium has most of the required skills and experience but there are a few gaps. The consortium will need to work hard to maintain a good working relationship.',2),(41,229,'7,8','The consortium is strong and contains all the required skills and experience. The consortium is likely to work well.',1),(42,229,'9,10','The consortium is ideally placed to carry out the project AND exploit the results. The skills are well balanced and the partners likely to form a strong consortium with good knowledge transfer.',0),(43,233,'1,2','The costs are not appropriate or justified. Any mix of research and development type is not justified.',4),(44,233,'3,4','The costs are either too high or too low to carry out the project. Poor justification is provided for any research and development type mix.',3),(45,233,'5,6','The project costs and justifications are broadly correct but there are some concerns. Any mix of research and development types is just about acceptable.',2),(46,233,'7,8','The project costs are appropriate and should be sufficient to successfully complete the project. Any mix of research and development types is justified and costed correctly.',1),(47,233,'9,10','The project costs are entirely appropriate. Any mix of research and development types (eg industrial research with some work packages of experimental development) is justified and costed correctly.',0),(48,237,'1,2','The work should be funded internally and does not deserve state funding.',4),(49,237,'3,4','There is not likely to be any improvement to the industrial partner\'s commitment to R&D. The additionally arguments are poor or not sufficiently justified.',3),(50,237,'5,6','The project will improve the industrial partners\' commitment to R&D. The additionality arguments are just about acceptable.',2),(51,237,'7,8','The project will increase the industrial partners\' commitment to R&D. The additionality arguments are good and justified.',1),(52,237,'9,10','The project will significantly increase the industrial partners\' R&D spend during the project and afterwards. The additionality arguments are very strong and believable.',0),(53,274,'No','One or more of the above requirements have not been satisfied.',1),(54,274,'Yes','The application contains the following:\nIs the consortia business led?\nAre there two or more partners to the collaboration?\nDoes it meet the scope of the competition as defined in the competition brief?',0),(55,278,'1,2','There is little or no business drive to the project.  References to the current state-of-the-art are not offered or are not relevant.  ',4),(56,278,'3,4','Project motivation is poorly defined or not relevant to the applicant or team.  References to the current state-of-the-art are not offered or are not relevant.  ',3),(57,278,'5,6','The project motivation is good but a lack of understanding of the nearest state-of-the-art or wider factors influencing this opportunity.  ',2),(58,278,'7,8','There is a good motivation for the project. There is a good awarenessof the nearest state-of-the-art and wider factors influencing the opportunity.  ',1),(59,278,'9,10','There is a compelling business motivation  for the project . There  is a clear understanding of the nearest state-of-the-art available.  The applicant has shown, if applicable, how the project will build on previous relevant work .   Any wider factors influencing this opportunity are identified. ',0),(60,282,'1,2','The approach is not well defined or inconsistent with the need or challenge identified in Q1.  There is no identification of how this will improve competitiveness.',4),(61,282,'3,4','The approach is poorly defined with an unconvincing link to the need or challenge identified in Q1. Improvement in competiveness and/or productivity is is not very convincing.',3),(62,282,'5,6','The project may address the need or challenge identified in Q1 and the innovations are highlighted. The level of innovation or freedom to operate is not strongly backed up with evidence.  The main risks are not fully