INSERT INTO `question` VALUES (43,'\0','Enter the full title of the project','','\0','Application details','Application details',1,NULL,2,19,NULL,'GENERAL'),(44,'','Please provide a short summary of your project. We will not score this summary.','','\0','Project summary','Project summary',2,NULL,2,19,NULL,'GENERAL'),(45,'','Please provide a brief description of your project. If your application is successful, we will publish this description. This question is mandatory but is not scored.','','\0','Public description','Public description',3,NULL,2,19,NULL,'GENERAL'),(46,'','If your application doesn\'t align with the scope, we will not assess it.','','\0','How does your project align with the scope of this competition?','Scope',4,NULL,2,19,NULL,'GENERAL'),(47,'',NULL,'','\0','What is the business opportunity that your project addresses?','Business opportunity',5,'1',2,20,10,'GENERAL'),(48,'',NULL,'','\0','What is the size of the potential market for your project?','Potential market',6,'2',2,20,10,'GENERAL'),(49,'',NULL,'','\0','How will you exploit and market your project?','Project exploitation',7,'3',2,20,10,'GENERAL'),(50,'',NULL,'','\0','What economic, social and environmental benefits do you expect your project to deliver and when?','Economic benefit',8,'4',2,20,10,'GENERAL'),(51,'','Describe the areas of work and your objectives. List all resource and management needs. Provide an overview of your technical approach.','','\0','What technical approach will you use and how will you manage your project?','Technical approach',9,'5',2,20,10,'GENERAL'),(52,'','Explain how your project is innovative in both a commercial and technical sense.','','\0','What is innovative about your project?','Innovation',10,'6',2,20,10,'GENERAL'),(53,'','We recognise that many of the projects we fund are risky. This is why we need to be sure that you have an adequate plan for managing this risk.','','\0','What are the risks (technical, commercial and environmental) to your project\'s success? What is your risk management strategy?','Risks',11,'7',2,20,10,'GENERAL'),(54,'','Describe your capability to develop and exploit this technology. Include details of your team\'s track record in managing research and development projects.','','\0','Does your project team have the skills, experience and facilities to deliver this project?','Project team',12,'8',2,20,10,'GENERAL'),(55,'','Tell us the total costs of the project and how much funding you need from Innovate UK. Please provide details of your expected project costs along with any supporting information. Please justify any large expenditure in your project.','','\0','What will your project cost?','Funding',13,'9',2,20,10,'GENERAL'),(56,'',' ','','\0','How does financial support from Innovate UK and its funding partners add value?','Adding value',14,'10',2,20,10,'GENERAL'),(57,'\0','Only your organisation can see this level of detail. All members of your organisation can access and edit your finances. We recommend assigning completion of your finances to one member of your team.','','','Provide the project costs for \'{organisationName}\'','Project finances',15,NULL,2,23,NULL,'GENERAL'),(58,'\0','To determine the level of funding you are eligible to receive please provide your business size using the <a href=\"http://ec.europa.eu/growth/smes/business-friendly-environment/sme-definition/index_en.htm\" target=\"_blank\" rel=\"external\">EU definition (opens in a new window)</a> for guidance.','','','Size','Business size',18,NULL,2,24,NULL,'GENERAL'),(59,'\0','Please tell us if you have applied for, or received any other public sector funding for this project. This information is important as other public sector support counts as part of the funding you can receive for your project.','','','Other funding','Other funding',20,NULL,2,25,NULL,'COST'),(60,'\0','Please enter the funding level that you would like to apply for in this application','','','Funding level','Funding level',19,NULL,2,25,NULL,'GENERAL'),(61,'\0','<a target=\"_blank\" href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance/guidance-for-academics-applying-via-the-je-s-system\">How do I create my Je-S output?</a>','','','Upload a pdf copy of the Je-S output confirming a status of \'With Council\'','Je-s Output',20,NULL,2,23,NULL,'GENERAL'),(62,'','<p>You can claim the labour costs of all employees you have working on your project.</p>','\0','',NULL,NULL,1,NULL,2,26,NULL,'GENERAL'),(63,'','If your application is awarded funding, you will need to account for all your labour costs as they occur. For example, you should keep timesheets and payroll records. These should show the actual hours worked by individuals and paid by the organisation.','','','Labour',NULL,2,NULL,2,26,NULL,'COST'),(64,'','<p>You can incur overhead costs associated with those directly working on the project as well as indirect (administration) overheads. To be eligible both overhead categories need to be directly attributable to the project. The indirect overheads need to be additional as well as directly attributable. Note that there are certain cost categories/activities which are not eligible. To find out which costs are ineligible/eligible refer to our <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs guidance</a>.</p>','\0','',NULL,NULL,1,NULL,2,27,NULL,'GENERAL'),(65,'','','','','Overheads','Indirect costs',2,NULL,2,27,NULL,'GENERAL'),(66,'','<p>You can claim the costs of materials used on your project providing:</p><ul class=\"list-bullet\"><li>they are not already purchased or included in the overheads</li><li>they are purchased from third parties</li><li>they won’t have a residual/resale value at the end of your project. If they do you can claim the costs minus this value</li></ul><p><a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\" rel=\"external\">Please refer to our guide to project costs for further information.</a></p>','\0','',NULL,NULL,1,NULL,2,28,NULL,'GENERAL'),(67,'','Please provide a breakdown of the materials you expect to use during the project','','','Materials','Materials',2,NULL,2,28,NULL,'COST'),(68,'','<p>You can claim the usage costs of capital assets you will buy for, or use on, your project.</p>','\0','',NULL,NULL,1,NULL,2,29,NULL,'GENERAL'),(69,'','Please provide a breakdown of the capital items you will buy and/or use for the project.','','','Capital Usage','Capital items',2,NULL,2,29,NULL,'COST'),(70,'','<p>You can subcontract work if you don’t have the expertise in your project team. You can also subcontract if it is cheaper than developing your skills in-house.</p>','\0','',NULL,NULL,1,NULL,2,30,NULL,'GENERAL'),(71,'','Please provide details of any work that you expect to subcontract for your project.','','','Sub-contracting costs','Sub-contracts',2,NULL,2,30,NULL,'COST'),(72,'','<p>You should include travel and subsistence costs that relate to this project. </p>','\0','',NULL,NULL,1,NULL,2,31,NULL,'GENERAL'),(73,'',NULL,'','','Travel and subsistence',NULL,2,NULL,2,31,NULL,'COST'),(74,'','<p>Please provide details of any project costs which cannot be covered by the other cost categories.</p>','\0','',NULL,NULL,1,NULL,2,32,NULL,'GENERAL'),(75,'','Please note that legal or project audit and accountancy fees are not eligible and should not be included as an \'other cost’. Patent filing costs of new IP relating to the project are limited to £7,500 for SME applicants only.  Please provide estimates of other costs that do not fit within any other cost headings.','','','Other costs','Other costs',2,NULL,2,32,NULL,'COST'),(76,'',NULL,'\0','\0','FINANCE_SUMMARY_INDICATOR_STRING',NULL,17,NULL,2,33,NULL,'GENERAL'),(77,'\0','','\0','\0',NULL,NULL,16,NULL,2,33,NULL,'GENERAL'),(78,'\0','Enter the full title of the project','','\0','Application details','Application details',1,NULL,3,34,NULL,'GENERAL'),(79,'','Please provide a short summary of your project. We will not score this summary.','','\0','Project summary','Project summary',2,NULL,3,34,NULL,'GENERAL'),(80,'','Please provide a brief description of your project. If your application is successful, we will publish this description. This question is mandatory but is not scored.','','\0','Public description','Public description',3,NULL,3,34,NULL,'GENERAL'),(81,'','If your application doesn\'t align with the scope, we will not assess it.','','\0','How does your project align with the scope of this competition?','Scope',4,NULL,3,34,NULL,'GENERAL'),(82,'','','','\0','What is the business need, technological challenge or market opportunity behind your innovation?','Need or challenge',5,'1',3,35,10,'GENERAL'),(83,'','','','\0','What approach will you take and where will the focus of the innovation be?','Approach and innovation',6,'2',3,35,10,'GENERAL'),(84,'','','','\0','Who is in the project team and what are their roles?','Team and resources',7,'3',3,35,10,'GENERAL'),(85,'','','','\0','What does the market you are targeting look like?',' Market awareness',8,'4',3,35,10,'GENERAL'),(86,'','','','\0','How are you going to grow your business and increase your productivity into the long term as a result of the project?','Outcomes and route to market',9,'5',3,35,10,'GENERAL'),(87,'','','','\0','What impact might this project have outside the project team?','Wider impacts',10,'6',3,35,10,'GENERAL'),(88,'','','','\0','How will you manage the project effectively?','Project management',11,'7',3,35,10,'GENERAL'),(89,'','','','\0','What are the main risks for this project?','Risks',12,'8',3,35,10,'GENERAL'),(90,'','','','\0','Describe the impact that an injection of public funding would have on this project.','Additionality',13,'9',3,35,10,'GENERAL'),(91,'',' ','','\0','How much will the project