ect. Any other funding received will need to be deducted from the total value of any funding you are claiming for this project.</p>','\0','',NULL,NULL,1,NULL,6,79,NULL,'GENERAL'),(183,'','Please note that legal or project audit and accountancy fees are not eligible and should not be included as an \'other cost’. Patent filing costs of New IP relating to the project are limited to £7,500 for SME applicants only.  Please provide estimates of other costs that do not fit within any other cost headings.','','','Other costs','Other costs',2,NULL,6,79,NULL,'COST'),(184,'',NULL,'\0','\0','FINANCE_SUMMARY_INDICATOR_STRING',NULL,17,NULL,6,80,NULL,'GENERAL'),(185,'\0','<h2 class=\"heading-medium\">Funding rules for this competition</h2><p>We will fund projects between &pound;500,000 and &pound;1.5 million. We may consider projects with costs outside of this range. We expect projects to last between 12 and 36 months.</p><p>Innovate UK\'s aim is to optimise the level of funding businesses receive. We also recognise the importance of research organisations\' contribution to R&amp;D projects. Therefore we require the following levels of participation:</p><ul class=\"list-bullet\"> <li>at least 70% of the total eligible project costs are incurred by commercial organisations and</li> <li>a maximum of 30% of total eligible project costs are available to research participants. Where there is more than one research participant, this maximum will be shared between them.</li></ul>','\0','\0',NULL,NULL,16,NULL,6,80,NULL,'GENERAL'),(186,'\0','Enter the full title of the project','','\0','Application details','Application details',1,NULL,7,81,NULL,'GENERAL'),(187,'','Please provide a short summary of your project. Make sure you include what is innovative about it.','','\0','Project summary','Project summary',2,NULL,7,81,NULL,'GENERAL'),(188,'','Please provide a brief description of your project. If your application is successful, we will publish this description. This question is m