of the Je-S output confirming a status of \'With Council\'','Je-s Output',20,NULL,7,85,NULL,'GENERAL'),(205,'','<p>You may claim the labour costs of all individuals you have working on your project.</p> <p> If your application is awarded funding, you will need to account for all your labour costs as they occur. For example, you should keep timesheets and payroll records. These should show the actual hours worked by individuals and paid by the organisation.</p>','\0','',NULL,NULL,1,NULL,7,88,NULL,'GENERAL'),(206,'',NULL,'','','Labour',NULL,2,NULL,7,88,NULL,'COST'),(207,'',NULL,'\0','',NULL,NULL,1,NULL,7,89,NULL,'GENERAL'),(208,'','<p>You may incur indirect support staff costs linked with your administrative work for the project. To be eligible, these costs should be directly attributable and incremental to the project. Indirect costs associated with commercial activities are not eligible and must not be included. For further information on which costs are eligible please read our <a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\">project costs guidance</a>.</p>','','','Overheads','Indirect costs',2,NULL,7,89,NULL,'GENERAL'),(209,'','<p>You can claim the costs of materials used on your project providing:</p><ul class=\"list-bullet\"><li>they are not already purchased or included in the administration support costs</li><li>they are purchased from third parties</li><li>they won’t have a residual/resale value at the end of your project. If they do you can claim the costs minus this value</li></ul><p><a href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance\" rel=\"external\">Please refer to our guide to project costs for further information.</a></p>','\0','',NULL,NULL,1,NULL,7,90,NULL,'GENERAL'),(210,'','Please provide a breakdown of the materials you expect to use during the project','','','Materials','Materials',2,NULL,7,90,NULL,'COST'),(211,'','<p>You should provide details of capital equipment and tools you will buy for, or use on, your project.</p>','\0','',NULL,NULL,1,NULL,7,91,NULL,'GENERAL'),(212,'','Please provide a breakdown of the capital items you will buy and/or use for the project.','','','Capital Usage','Capital items',2,NULL,7,91,NULL,'COST'),(213,'','<p>You may subcontract work if you don’t have the expertise in your consortium. You can also subcontract if it is cheaper than developing your skills in-house.</p>','\0','',NULL,NULL,1,NULL,7,92,NULL,'GENERAL'),(214,'','Please provide details of any work that you expect to subcontract for your project.','','','Sub-contracting costs','Sub-contracts',2,NULL,7,92,NULL,'COST'),(215,'','<p>You should include travel and subsistence costs that relate only to this project. </p>','\0','',NULL,NULL,1,NULL,7,93,NULL,'GENERAL'),(216,'',NULL,'','','Travel and subsistence',NULL,2,NULL,7,93,NULL,'COST'),(217,'','<p>Please tell us if you have applied for or received any other public sector funding for this project. Any other funding received will need to be deducted from the total value of any funding you are claiming for this project.</p>','\0','',NULL,NULL,1,NULL,7,94,NULL,'GENERAL'),(218,'','Please note that legal or project audit and accountancy fees are not eligible and should not be included as an \'other cost’. Patent filing costs of New IP relating to the project are limited to £7,500 for SME applicants only.  Please provide estimates of other costs that do not fit within any other cost headings.','','','Other costs','Other costs',2,NULL,7,94,NULL,'COST'),(219,'',NULL,'\0','\0','FINANCE_SUMMARY_INDICATOR_STRING',NULL,17,NULL,7,95,NULL,'GENERAL'),(220,'\0','<h2 class=\"heading-medium\">Funding rules for this competition</h2><p>We will fund projects between &pound;500,000 and &pound;1.5 million. We may consider projects with costs outside of this range. We expect projects to last between 12 and 36 months.</p><p>Innovate UK\'s aim is to optimise the level of funding businesses receive. We also recognise the importance of research organisations\' contribution to R&amp;D projects. Therefore we require the following levels of participation:</p><ul class=\"list-bullet\"> <li>at least 70% of the total eligible project costs are incurred by commercial organisations and</li> <li>a maximum of 30% of total eligible project costs are available to research participants. Where there is more than one research participant, this maximum will be shared between them.</li></ul>','\0','\0',NULL,NULL,16,NULL,7,95,NULL,'GENERAL'),(221,'\0','<a target=\"_blank\" href=\"https://www.gov.uk/government/publications/innovate-uk-completing-your-application-project-costs-guidance/guidance-for-academics-applying-via-the-je-s-system\">How do I create my Je-S output?</a>','','','Upload a pdf copy of the Je-S output confirming a status of \'With Council\'','Je-s Output',20,NULL,6,70,NULL,'GENERAL'),(222,'\0','Enter the full title of the project','','\0','Application details','Application details',1,NULL,8,96,NULL,'GENERAL'),(225,'',NULL,'','\0','What is the business opportunity and potential market for your project?','Business opportunity and potential market',5,'1',8,97,10,'GENERAL'),(226,'','Explain how your project is innovative in both a commercial and technical sense.','','\0','What is innovative about your project?','Innovation',6,'2',8,97,10,'GENERAL'),(227,'','Describe your ability to develop and exploit this technology. Include details of your team\'s track record in managing research and development projects.','','\0','Who is in the project team and what are their roles?','Project team',7,'3',8,97,10,'GENERAL'),(228,'','Estimate the total costs of the project and tell us how much funding you need from Innovate UK and why.','','\0','How much will your project cost, and how does it represent value for money for your team and the taxpayer?','Funding and adding value',8,'4',8,97,10,'GENERAL'),(229,